INSERT INTO `fasi_task` (`id`, `task_text`) VALUES
(1, 'Melatih dan membimbing pelajar berdaftar dalarn Kursus Ko-Kurikulurn berkredlt berkaitan rnengikut sukatan yang telah dltetapkan.'),
(2, 'Memastikan semua pelajar rnematuhi dan tidak rnelanggar peraturan-peraturan yang berkuatkuasa di Universiti Malaysia Kelantan (UMK) serta memantau aktiviti kursus agar selari dengan hasrat, matlamat dan anspirasi UMK.'),
(3, 'Memastikan kehadiran setiap pelajar yang berdaftar dalarn Kursus Ko-Kurikulurn berkredit berkenaan hadir sekurang-kurangnya 80% daripada jumlah keseluruhan kuliah yang diadakan.'),
(4, 'Menepati masa setiap jadual kuliah yang telah ditetapkan.'),
(5, 'Menilai, menyemak dan menentukan keputusan pelajar yang berdaftar mengikut kursus berkaitan .'),
(6, 'Mengambil dan rnemulangkan semua peralatan yang dipinjam di Pusat Ko-Kurikulurn rnengikut masa yang ditetapkan.'),
(7, 'Membantu Pusat Ko-Kurikulum dalam memastikan kebajikan dan keselamatan setiap pelajar yang berdaftar.'),
(8, 'Memastikan semua pelajar yang berdaftar dalam kursus berkaitan sekurang-kurangnya mendapat pengetahuan asas kursus yang diikuti.'),
(9, 'Membantu Pusat Ko-Kurikulum dan UMK amnya melahirkan graduan yang berkuallti, berdaya saing, pemikiran kreatif, inovatif dan bersahsiah tinggi serta berupaya untuk terus maju di dalam pelbagai bidang melalui penglibatan dalarn kursus yang diikuti.'),
(10, 'Menjayakan setiap program/aktiviti yang telah dirancang dan bakal dilaksanakan oleh Pusat KoKurikulum.');
