(7, 201920201, 'Program Pemerkasaan Kendiri', 'S38YKS', 248, 0, '2019-09-05', '2019-09-05', 'Dataran Parkir Masjid Tengku Muhammad Fa-Iz Petra', 'Pusat Kokurikulum Universiti Malaysia Kelantan', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan daripada Pusat Ko Kurikulum, Pejabat Hal Ehwal Pelajar dan Alumni bagi mengadakan Program Pemerkasaan Kendiri (Ko Kurikulum Berkredit). Program ini dicadangkan untuk dilaksanakan pada 26 November 2019 (Selasa) di Universiti Malaysia Kelantan (UMK), Kampus Jeli.', 'Kemahiran insaniah merupakan salah satu elemen yang penting dalam membentuk seseorang individu yang cemerlang dari pelbagai aspek kehidupaun. Pendedahan awal mengenai kemahiran insaniah perlu dilaksanakan kepada para mahasiswa bagi membantu mereka membina keyakinan dan imej diri yang positif dengan mempunyai nilai penghargaan diri yang tinggi. \r\n\r\nMotivasi merupakan sumber atau alat yang menggalakkan seseorang untuk mencapai matlamat dan terus berusaha untuk mencapai matlamat tersebut sehingga berjaya, Cox (1994). Oleh yang demikian mahasiswa yang mempunyai motivasi yang tinggi akan mempamerkan kesungguhan untuk berjaya. Mereka seboleh mungkin mengelak dari melakukan tingkah laku negatif dalam kehidupan.\r\n\r\nKepimpinan juga merupakan salah satu elemen penting dalam membentuk mahasiswa yang berkualiti kerana kepimpinan merupakan salah satu perkara yang sangat berkait rapat dengan kehidupan manusia seharian.\r\n\r\nSehubungan itu, program-program yang berbentuk pemantapan kendiri bagi meningkatkan nilai kepimpinan kerjasama, kompetensi dan motivasi kepada mahasiswa  wajar dilaksanakan supaya mereka mampu bersaing dengan baik untuk meniti kehidupana pada masa hadapan.\r\n', '', 'Pelajar UMK, Kampus Jeli', '', '700.00', '700.00', 'NOOR AZMI BIN AHMAD', '680411055383', '01045022460856', 'BIMB', 'mieranggi@gmail.com', 0, '2019-10-28', '2019-10-28', 0, 0, '', '2019-10-30', '2019-09-06 02:55:02', '0000-00-00 00:00:00', '2019-10-28 01:40:40', '', '0000-00-00', '08', 30),
(8, 201920201, 'Program Kejohanan Pingpong Terbuka (Novice Beginner Lelaki Dan Perempuan & Novice Junior) Peringkat Negeri Kelantan', 'XBGQAJ', 259, 0, '2019-09-05', '2019-09-05', 'Dewan Keusahawanan Universiti Malaysia, Kelantan, Malaysia', 'Pusat Ko-kurikulum Universiti Malaysia Kelantan', 'Kertas kerja “KEJOHANAN PINGPONG TERBUKA PERINGKAT UNIVERSITI MALAYSIA KELANTAN” ini disediakan adalah bagi memohon kelulusan dari Pengarah Pusat Kokurikulum iaitu Dr. Mohd Nazri bin Muhayiddin. Program ini merupakan sebuah kerjasama dari pihak Kelab Pengurusan Organisasi serta kerjasama dari Kelab Pingpong Universiti Malaysia Kelantan dalam menjayakan  sebuah  program  yang  bercirikan  kesukanan. Selain itu, program ini dilaksanakan bagi memberi pendedahan kepada pelajar tahun satu tentang menguruskan dan mengelola sesebuah program di peringkat universiti. Program ini berhasrat supaya pelajar dapat didedahkan dengan pengaplikasian semangat kesukanan, kerjasama antara pasukan dan kepentingan kecergasan diri bagi setiap individu. Hal ini dapat meningkatkan kemahiran pelajar dalam menguruskan sesebuah projek yang lebih formal.', 'Program ini diadakan adalah untuk meningkatkan kemahiran pelajar dalam menguruskan sesebuah program sejajar dengan objektif pembelajaran. Melalui program ini, antara kemahiran yang dapat ditingkat ialah seperti kemahiran menguruskan ahli-ahli yang terlibat untuk menjayakan program. Selain itu, pelajar dapat meningkatkan kemahiran berkomunikasi antara pihak berkepentingan bagi merealisasikan matlamat program ini. Pelajar juga dapat belajar tentang pentingnya kerjasama antara kumpulan dalam merealisasikan sesuatu program.\r\nDisamping itu, program ini berhasrat untuk memupuk semangat kesukanan dalam diri setiap pelajar. Selain itu dengan mengadakan kejohanan terbuka seperti ini akan dapat merapatkan hubungan silaturrahim antara pelajar. Hal ini juga akan dapat mendedahkan betapa pentingnya sukan dalam menjana kecergasan diri, mental dan fizikal. Sehubungan dengan itu, usaha untuk meningkatkan kesedaran orang ramai agar bersukan hendaklah dilaksanakan dari semasa ke semasa.\r\n \r\nDiharapkan program ini akan dapat memberikan manfaat yang  berguna kepada semua pihak terutamanya mahasiswa di UMK amnya dan pelajar yang terlibat yang terbabit khususnya. Dengan itu, segala kerjasama dan sokongan dari semua pihak sama ada yang terlibat secara langsung atau tidak langsung amatlah diharapkan. Sesungguhnya hasrat murni dalam merealisasikan matlamat program ini hanya ALLAH S.W.T sahaja yang mampu.\r\n\r\n', '', 'Terbuka Kelantan', '', '500.00', '500.00', '', '0', '', '', '', 0, '2019-11-10', '0000-00-00', 0, 0, '', '0000-00-00', '2019-09-06 03:05:25', '0000-00-00 00:00:00', '2019-11-10 13:14:52', '', '0000-00-00', '-', 0),
(9, 201920201, 'KARNIVAL RAMPAIAN TRADISIONAL MELAYU SEMPENA KARNIVAL KOKURIKULM UMK 2019', '383344', 237, 0, '2019-09-05', '2019-09-05', 'DEWAN KEUSAHAWANAN UMK KAMPUS KOTA', 'Pusat KoKurikulum UMK', 'Tujuan kertas kerja ini dikemukakan ialah untuk mendapat pertimbangan dan kelulusan daripada Pusat KoKurikulum, Pejabat hal ehwal Pelajar dan Alumni berhubung cadangan menganjur Karnival Rampaian Tradisional Melayu sempena Karnival KoKurikulum 2019.', '1.1	Tarian Rampaian Tradisional merupakan tarian yang amat terkenal dan ditarikan oleh seluruh masyarakat yang berbilang kaum di negara Malaysia.\r\n\r\n1.2	Kursus UKP 1031 Tarian Tradisional di perkenalkan di Universiti Malaysia Kelantan adalah untuk memberi pendedahan kepada mahasiswi mengenali dan mempelajari seni persembahan ini agar tidak dilupakan.\r\n\r\n1.3	Karnival Tarian Rampaian Tradisional Melayu ini diadakan oleh pelajar-pelajar dari LK 1 yang di ajar oleh Encik Wan Mohd Arizuddin Bin Wan Mohd Nor.\r\n', '', 'Pelajar UKP1031', '', '658.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-06 03:07:16', '0000-00-00 00:00:00', '2020-03-18 11:05:16', '', '0000-00-00', '-', 0),
(10, 201920201, 'Colour Run Festival', 'HS8FAD', 244, 0, '2019-09-06', '2019-09-06', 'Hadapan Dewan Utama UMK Jeli', '', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada Pusat Ko-Kokurikulum, Pejabat Hal Ehwal Pelajar bagi cadangan mengadakan program Colour Run bagi Kelab Pengurusan Organisasi(Ko-kokurikulum berkredit) di perkarangan UMK Kampus Jeli.', 'Program seumpama ini membuka ruang untuk warga kampus terutamanya pelajar mengasah bakat,bersaing dalam sukan larian dan menjadi medan mempromosikan gaya hidup sihat serta diharapkan dapat mengeratkan silaturahim antara pelajar dan saling mengenali antara satu dengan yang lain. ', '', 'Pelajar dan orang awam ', 'Kelab Pengurusan Organisasi UMK Jeli', '505.00', '210.00', 'NUR IZZATI BINTI MD AKIL', '991229036336', '03054020732724', 'BIMB', 'ezzaizzati991@gmail.com', 309, '2019-11-14', '2019-11-14', 0, 0, '', '2019-11-18', '2019-09-06 17:03:52', '0000-00-00 00:00:00', '2019-11-14 14:45:27', 'UMK.B01.03.03.700-8/1/1 JLD 2(35)', '0000-00-00', '08', 30),
(11, 201920201, 'Kejohanan Bola Sepak  Bagi Kursus UKS1021 Bola Sepak, (KO-Kurikulum Berkredit) Di Kampus Bachok.', 'DGD29D', 239, 0, '2019-09-06', '2019-09-06', 'Padang UMK Kampus Bachok', '', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan  kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan Mengadakan Kejohanan Bola Sepak bagi Kursus UKS1021 (Ko-Kurikulum Berkredit) di Kampus Bachok,  Universiti Malaysia Kelantan (UMK).', 'Kejohanan ini adalah kesinambungan daripada kursus Ko-Kurikulum berkredit yang mana melalui kejohanan ini dapat memupuk semangat kesukanan dan memberi peluang untuk pelajar menonjolkan kemahiran insaniah.', '', 'Seramai 40 orang pelajar (32 orang pelajar yang mengikuti kursus UKS1021 & 8 orang pelajar tahun 1)', '', '500.00', '440.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-06 20:57:42', '0000-00-00 00:00:00', '2019-10-17 11:16:27', '', '0000-00-00', '-', 20),
(12, 201920201, 'KEJOHANAN SUKAN BOLA JARING ANTARA KUMPULAN', '0G399D', 258, 0, '2019-09-08', '2019-09-08', 'INSTITUT KEMAHIRAN BELIA NEGARA (IKBN), TANGOK', '', 'Tujuan kertas kerja cadangan ini adalah untuk memohon pertimbangan dan kelulusan peruntukan kewangan daripada pusatKo-kurikulum, Bahagian Hal Ehwal Pelajar dan Alumni, UMK bagi mengadakan Kejohan Sukan Bola Jaring antara Kumpulan sempena Karnival Kokurikulum Kampus Bachok', 'Membentuk pembinaan pasukan bagi memantapkan hubungan kerjasama antara ahli\r\nProgram akan berlangsung pada 26 November 2019. \r\nJuga berperanan mempromosikan gaya hidup sihat bagi mahasiswa/mahasiswi mencegah diri dari melibatkan diri dengan kegiatan yang tidak berfaedah.', '', '29 mahasiswa Krusus Kokurikulum Berkredit UKS1011, UMK', '', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-08 09:21:17', '0000-00-00 00:00:00', '2019-10-16 15:49:42', '', '0000-00-00', '-', 20),
(13, 201920201, 'Program \"Lead Fun Race\"', 'C5GCSD', 315, 0, '2019-09-08', '2019-09-08', ' Universiti Malaysia Kelantan (UMK) Kampus Kota', '', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan  kelulusan peruntukan daripada Pusat \r\nKo-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Mengadakan Program \"Lead Fun Race\" Bagi Kursus Kepimpinan Dan Motivasi \r\n(Ko-Kurikulum Berkredit) di Kampus Kota, Universiti Malaysia Kelantan (UMK).', 'Program \"Lead Fun Race\" ini merupakan sebuah program \"Team Building\" untuk para mahasiswa/i yang dijalankan oleh Kursus Kepimpinan dan Motivasi untuk membina kerjasama di dalam kumpulan dan kualiti kepimpinan di kalangan peserta program. Selain itu, program ini juga dapat memberi suntikan semangat dan motivasi bagi membentuk kepimpinan yang lebih dinamik, sistematik dan berkesan di samping dapat mengharumkan nama Universiti Malaysia Kelantan sebagai sebuah universiti yang mampu melahirkan mahasiswa berkepimpinan.', '', 'Mahasiswa dan Mahasiswi UMK Kampus Kota', '', '700.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-08 10:01:31', '0000-00-00 00:00:00', '2019-10-25 15:14:06', '', '0000-00-00', '-', 20),
(14, 201920201, 'CADANGAN MENGADAKAN PERTANDINGAN PETANQUE TERTUTUP BAGI KURSUS PETANQUE UKS10901 (KO-KURIKULUM BERKREDIT) DI KAMPUS KOTA UNIVERSITI MALAYSIA KELANTAN', 'D6DFF9', 277, 0, '2019-09-08', '2019-09-08', 'Cabin UMK, Kampus Kota', 'pelajar UKS10901-LK1-PETANQUE   (umk kampus kota)  dan  pelajar UKS10901-LJ1-PETANQUE   (umk kampus jeli)  ', 'Tujuan kertas kerja ini dikemukan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi cadangan mengadakan Pertandingan Petanque Tertutup bagi kursus Petanque (Ko-kurikulum Berkredit) (LB1) di Kampus Kota, Universiti Malaysia Kelantan (UMK).', 'Program ini bertujuan memberi ruang kepada pelajar untuk mempelajari cara untuk meguruskan satu pertandingan dan cara bermain dengan betul. Selain itu, program ini bukan sahaja mengajar pelajar untuk meguruskan satu pertandingan dalam sukan Petanque malah menjadi satu platform bagi pelajar untuk mengeratkan silaturrahim serta berkongsi pendapat dalam menaikkan nama sukan Petanque ini.', '', 'pelajar UKS10901-LB1-PETANQUE   (umk, bachok)   ', '', '500.00', '550.00', 'MOHAMAD LUKMAN BIN AHMAD SABERI', '890928035057', '03018020924226', 'BIMB', 'lukman.as@umk.edu.my', 0, '2019-11-03', '2019-11-03', 0, 0, '', '2019-11-19', '2019-09-08 15:26:23', '0000-00-00 00:00:00', '2019-11-03 16:29:27', 'UMK.B01.03.03.700-8/1/1 JLD 2(50)', '0000-00-00', '08', 30),
(15, 201920201, 'Santun Budaya', 'NSXFWS', 233, 0, '2019-09-08', '2019-09-08', 'UMK Bachok', '', 'Melengkapkan Projek Akhir Kursus Pengucapan Awam disamping memupuk nilai tatasusila yang murni serta meningkatkan keyakinan diri dalam kalangan mahasiswa.', 'Program Santun Budaya merupakan salah satu projek akhir bagi kursus Pengucapan Awam (UKD1021). Hal ini demikian kerana, santun budaya ini sebenarnya boleh membawa maksud satu kelakuan yang sangat sopan. Maka dengan itu, program ini sesuai dilaksanakan bagi memupuk tatasusila yang murni di samping dapat meningkatkan keyakinan serta cara menampilkan diri yang baik di khalayak orang ramai.\r\nSelain itu, program ini mendapat sokongan daripada penasihat dan sambutan daripada mahasiswa dan mahasiswi.\r\n', '', 'Mahasiswa Pengucapan Awam & Mahasiswa UMK Bachok', '', '500.00', '605.00', 'SUDIRMAN BIN KIFFLI', '890902135295', '11125460050487', 'RHB', 'sudirman.k@umk.edu.my', 0, '2019-10-31', '2019-10-31', 0, 0, '', '2019-11-04', '2019-09-08 15:41:29', '0000-00-00 00:00:00', '2019-10-31 12:29:37', 'UMK.B01.03.03/700-8/1/1 JLD 2(12)', '0000-00-00', '08', 30),
(16, 201920201, 'Kejohanan Petanque Tertutup  UMK', '3S3DKZ', 246, 0, '2019-09-08', '2019-09-08', 'Gelanggang Petanque UMK', 'Pusat Sukan dan Kebudayaan', 'Tujuan kertas kerja ini dikemukakan ialah untuk mendapat pertimbangan dan kelulusan peruntukan daripada pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi cadangan mengadakan Kejohanan Petanque Tertutup bagi kursus Petanque (Ko-kurikulum Berkredit) di Kampus Jeli, Universiti Malaysia Kelantan (UMK).', 'Merupakan platform terbaik bagi memilih pelapis atlet petanque yang layak dan berbakat untuk mewakili UMK.\r\nMemberi ruang kepala pelajar untuk mempelajari cara untuk menguruskan pertandingan dengan cara yang betul dan bersistematik.\r\nMeningkatkan produktiviti dan sillaturahim antara pelajar.\r\n', '', 'Pelajar UMK', '', '745.00', '500.00', 'NURSHAFIKAH BINTI SHAARI', '910915035934', '03063020320545', 'BIMB', 'shafikah.s@umk.edu.my', 0, '2019-11-04', '2019-11-04', 0, 0, '', '2019-11-06', '2019-09-08 16:21:34', '0000-00-00 00:00:00', '2019-11-04 22:34:47', 'UMK.B01.03.03/700-8/1/1 JLD 2(31)', '0000-00-00', '08', 30),
(17, 201920201, 'Pertandingan Memanah Bersempena Karnival Kokurikulum', 'A35ASY', 287, 0, '2019-09-08', '2019-09-08', 'Padang Bola Sepak, Universiti Malaysia Kelantan Bachok', 'Kelab Memanah UMK', 'Bagi memenuhi keperluan kursus kokurikulum dalam membuat penilaian terhadap pembelajaran pelajar bagi Kursus Memanah (UKS11201) Semester September Sesi 2019/2020.', 'Pertandingan memanah ini akan dikelolakan oleh pelajar daripada Kursus Memanah (UKS11201) Semester September Sesi 2019/2020 pada 26 November 2019 di Padang Bola Sepak, Universiti Malaysia Kelantan Bachok. Pertandingan ini terbahagi kepada dua kategori iaitu pertandingan yang akan disertai oleh pelajar Kursus Memanah (UKS11201) dan pertandingan memanah terbuka yang boleh disertai oleh pelajar selain pelajar Kursus Memanah (UKS11201) dan juga staf UMK.', '', 'Warga UMK Bachok (Staf & Pelajar)', '', '2350.00', '606.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-08 17:11:18', '0000-00-00 00:00:00', '2019-10-22 11:06:11', '', '0000-00-00', '-', 20),
(18, 201920201, 'Cadangan Mengadakan Pameran Permainan Tradisional Di Dewan Keusahawanan.', '4GFD3S', 261, 0, '2019-09-08', '2019-09-08', 'Dewan Keusahawanan Universiti Malaysia Kelantan.', '', 'Tujuan kertas cadangan ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada Pusat Kokurikulum,Pejabat Hal Ehwal Pelajar bagi mengadakan Pameran Permainan Tradisional Malaysia yang akan diadakan di Dewan Keusahawanan Universiti Malaysia Kelantan.', 'Pameran Permainan Tradisional di Dewan Keusahawanan Universiti Malaysia Kelantan ini akan diadakan pada 26 November 2019 (Selasa),bermula pada pukul 9.00pagi hingga 6.00 petang.Majlis ini dianjurkan sebagai penilaian kepada komponen Pengurusan Aktiviti yang merupakan salah satu komponen utama yang dinilai bagi kursus Kokurikulum Berkredit.Majlis ini dianjurkan oleh mahasiswa Universiti Malaysia Kelantan yang menjalani kursus Rekabentuk Weblog yang dipimpin oleh Encik Mohamad Shahfik Afendi Bin Abdul Ghani.Untuk menjayakan program ini dengan baik,ahli-ahli jawatankuasa juga telah dipilih bagi memastikan program ini dapat  dijalankan dengan lancar dan sempurna.', '', 'Pelajar Universiti Malaysia Kelantan.', '', '500.00', '326.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-08 20:29:29', '0000-00-00 00:00:00', '2019-10-21 10:56:17', '', '0000-00-00', '-', 20),
(19, 201920201, 'PERSEMBAHAN MUZIK WAYANG KULIT SEMPENA KARNIVAL KOKURIKULUM UMK 2019', '89GLUE', 289, 0, '2019-09-09', '2019-09-09', 'LAMAN PERMAI FTKW UMK BACHOK', 'Kumpulan Wayang Kulit Sri Mattaq Kuala Krai Kelantan', 'Tujuan kertas ini dikemukakan ialah untuk mendapat kelulusan berhubung cadangan mengadakan persembahan Muzik Wayang Kulit sempena Karnival Kokurikulum UMK 2019', 'Wayang Kulit ini merupakan persembahan kesenian Kelantan yang menjadi kebanggaan rakyat Kelantan. Wayang Kulit UKP 10801 baru sahaja diperkenalkan di UMK Bachok. ini merupakan kali pertama mereka menyertai dan mengadakan persembahan Wayang Kulit setelah menjalani latihan mingguan.', '', 'Pelajar Seni Persembahan UKP 10801 Wayang Kulit dan tetamu yang hadir program Karnival KoKurikulum 2019', '', '500.00', '500.00', 'MUHAMAD SHAIFUDDEN BIN SABKI', '931122155015', '7611534444', 'CIMB', 'shaifudden15@gmail.com', 0, '2019-11-03', '2019-11-03', 0, 0, '', '2019-11-04', '2019-09-09 08:56:36', '0000-00-00 00:00:00', '2019-11-03 16:48:01', 'UMK.B01.03.03/700-8/1/1 JLD 2(13)', '0000-00-00', '08', 30),
(20, 201920201, 'Pemeran Fotografi Sempena Karnival Ko-Kurikulum 2019 ', '3RIR6H', 281, 0, '2019-09-09', '2019-09-09', 'UMK Kampus Kota', '', 'Kertas kerja ini diadakan bagi memohon kelulusan dari YBhg. Timbalan Naib Canselor, Hal Ehwal Pelajar dan Alumni (HEPA) Univesiti Malaysia Kelantan untuk mengadakan program “PAMERAN SEMPENA KARNIVAL KOKURIKULUM KELAB FOTOGRAFI” yang akan diadakan pada 26 November 2019.', 'Memberi pendedahan tentang aktiviti fotografi sesi 2019/2020 bagi kedua-dua kelas dibawah kelab fotografi supaya jalinan antara kedua-dua kelas tidak terputus hubungan serta memberi peluang kepada setiap pelajar untuk berkongsi kelebihan dan pengalaman mereka dan mengaplikasikan di dalam setiap aktiviti yang diberi. \r\n\r\nSelain dari itu aktiviti ini juga diharap akan memberi impak positif dalam diri peserta supaya lebih cekap untuk menghadapi pelbagai situasi serta melahirkan sikap kepimpinan dalam diri agar dapat membantu mahsiswa di Universiti untuk yakin dalam apa jua situasi.\r\n', '', 'Mahasiswa Universiti Malaysia Kelantan (UMK)', '', '3100.00', '1700.00', 'MUHAMMAD MUIZ AZRAI BIN GHAZALI', '990904116299', '13017028723759', 'BIMB', 'azraimuiz99@gmail.com', 0, '2019-11-04', '2019-11-05', 0, 0, '', '2019-11-06', '2019-09-09 19:56:38', '0000-00-00 00:00:00', '2019-11-05 10:27:16', 'UMK.B01.03.03/700-8/1/1 JLD 2(26)', '0000-00-00', '08', 30),
(21, 201920201, 'CADANGAN MENGADAKAN KAWAD KAKI DAN KAWAD TEMPUR', '9TF47F', 274, 0, '2019-09-09', '2019-09-09', 'LAMAN PERMAI DAN PARKIR FTKW BACHOK', '-', 'MEMPELAJARI TEKNIK PERGERAKAN KAKI DAN TANGAN DENGAN TEPAT SERTA DAPAT MENDISIPLINKAN DIRI.\r\n', 'BERKAWAT ADALAH ASAS UNTUK MEMBENTUK TATATERTIB DALAM PASUKAN BERTUJUAN UNTUK MEMBENTUK SEORANG AHLI YANG MEMPUNYAI TAHAP DISIPLIN YANG TINGGI CERGAS DAN TAAT PERINTAH DISAMPING DAPAT MELAHIRKAN MODAL INSAN YANG MAMPAN', '', 'WATANIAH BACHOK', '-', '500.00', '0.00', 'ABD. AZIZ BIN MSOD', '710408105655', '03036020381832', 'BIMB', 'azizm@umk.edu.my', 0, '2019-11-07', '2019-11-07', 0, 0, '', '2019-11-18', '2019-09-09 22:13:19', '0000-00-00 00:00:00', '2019-11-07 14:40:15', 'UMK.B01.03.03.700-8/1/1 JLD 2(36)', '0000-00-00', '08', 30),
(22, 201920201, 'Latihan Simulasi Kecemasan', 'NI485Y', 292, 0, '2019-09-10', '2019-09-10', 'Perkarangan Universiti Malaysia Kelantan Kampus Jeli', 'Bulan Sabit Merah Negeri Kelantan', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukkan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi cadangan mengadakan Latihan Simulasi Kecemasan bagi pelajar kursus UKU10702 Bulan Sabit Merah di UMK Jeli.', 'Bulan Sabit Merah Malaysia merupakan subjek kokurikulum UKU 10702 Universiti Malaysia Kelantan yang berteraskan semangat kesukarelawan dan kerja amal dalam kalangan pelajar. Selain itu,  ahli jawatankuasa serta ahli yang terlibat dalam program ini  dapat didedahkan tentang teknik pertolongan cemas yang betul dan lebih mendalam yang menjadi nilai tambah dalam diri setiap ahli.', '', 'Pelajar UKU10702 Bulan Sabit Merah Malaysia(BSMM) semester September sesi 2019/2020', '', '1430.00', '1430.00', 'MARDINI BINTI ZAHIDI BAKI', '960402035096', '03036021072718', 'BIMB', 'mardinizahidi@gmail.com', 0, '2019-11-10', '2019-11-10', 0, 0, '', '0000-00-00', '2019-09-10 09:07:27', '0000-00-00 00:00:00', '2019-11-10 14:28:41', '', '0000-00-00', '-', 20),
(23, 201920201, 'CADANGAN MENGADAKAN KEJOHANAN FUTSAL  BAGI KURSUS UKS11001 FUTSAL, (KOKURIKULUM BERKREDIT) UNIVERSITI MALAYSIA KELANTAN', 'P8SFP3', 293, 0, '2019-09-10', '2019-09-10', 'KB ARENA FUTSAL', 'KB ARENA FUTSAL', '	Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan  kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan Mengadakan Kejohanan Futsal bagi Kursus UKS11001 (Ko-Kurikulum Berkredit) di Kampus Kota,  Universiti Malaysia Kelantan (UMK).', 'Kejohanan ini adalah kesinambungan daripada kursus Ko-Kurikulum berkredit yang mana melalui kejohanan ini dapat memupuk semangat kesukanan dan memberi peluang untuk pelajar menonjolkan kemahiran insaniah.', '', 'PELAJAR', 'UMK', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-10 10:45:19', '0000-00-00 00:00:00', '2019-10-22 08:28:06', '', '0000-00-00', '-', 20),
(24, 201920201, 'PROGRAM EXPLORACE KO-KURIKULUM BAGI KURSUS UKD 1031 KEPIMPINAN DAN MOTIVASI\r\n', '2HVG4Q', 267, 0, '2019-09-10', '2019-09-10', 'LAMAN MONSUN UMK KAMPUS BACHOK', 'Kelas Ko-Kurikulum Berkredit bagi UMK Kampus Bachok', '1. Memberi pendedahan terhadap prinsip kepimpinan dan motivasi. \r\n\r\n2. Mempertingkatkan pengetahuan dan kemahiran dalam kepimpinan serta berkeyakinan terhadap diri sendiri.', '1. Kursus kokurikulum adalah sangat penting bagi mahasiswa dan mahasiswi bagi melahirkan mahasiswa dan mahasiswi yang proaktif dan berdaya saing dalam menguruskan program di universiti. Selain itu, ia juga dapat membuktikan bahawa mahasiswa dan mahasiswi tersebut mampu membimbing rakan-rakan yang lain dalam meningkatkan semangat kepimpinan yang kuat dalam diri.\r\n\r\n2. Program Explorace Ko-kurikulum Kepimpinan dan Motivasi ini adalah sangat penting dalam membina jati diri pelajar dan semangat kerjasama untuk berusaha menguruskan program sama ada secara berkumpulan atau individu.\r\n', '', 'STAF DAN PELAJAR UMK', 'Tidak Berkaitan', '780.00', '780.00', 'NOR ATEKAH BINTI ISMAIL', '850525015514', '14162020139644', 'BIMB', 'atekah.i@umk.edu.my', 0, '2019-11-04', '2019-11-04', 0, 0, '', '2019-11-04', '2019-09-10 14:42:20', '0000-00-00 00:00:00', '2019-11-04 12:52:35', 'UMK.B01.03.03/700-8/1/1 JLD 2(14)', '0000-00-00', '08', 30),
(25, 201920201, 'PERSEMBAHAN TARIAN TRADSIONAL SEMPENA KARNIVAL KOKURIKULUM UMK 2019', '78D8ZF', 257, 0, '2019-09-10', '2019-09-10', 'LAMAN PERMAI FTKW, UMK BACHOK', '', 'Tujuan utama kertas kerja ini adalah untuk mendapat kelulusan bagi mengadakan Persembahan Tarian tradisional sempena Karnival KoKurikulum UMK 2019', 'Memberikan ilmu pengetahuan dan pengalaman baru kepada semua pelajar yang terlibat. Melatih pelajar bagaimana cara mengurus dan membuat persembahan sesuatu majlis.', '', 'Pelajar KoKurikulum UKP1031 (LB1)', '', '800.00', '800.00', 'MUHAMMAD LUQMANUL HAKIM BIN CHE SEMAN', '890603035163', '153131081265', 'MAYBANK', 'luqmanulhakimcheseman@gmail.com', 0, '2019-11-06', '2019-11-06', 0, 0, '', '2019-11-06', '2019-09-10 17:07:32', '0000-00-00 00:00:00', '2019-11-06 11:52:05', 'UMK.B01.03.03/700-8/1/1 JLD 2(32)', '0000-00-00', '08', 30),
(26, 201920201, 'PERSEMBAHAN MAKYUNG SEMPENA KARNIVAL KOKURIKULUM UMK 2019', 'FPZPTX', 238, 0, '2019-09-10', '2019-09-10', 'Laman Permai FTKW, UMK Bachok', 'Seksyen Kebudayaan, Pusat Sukan dan Kebudayaan', 'Tujuan utama kertas kerja ini adalah untuk mendapat kelulusan bagi mengadakan Persembahan Makyung sempena Karnival KoKurikulum UMK 2019\r\n\r\n\r\n', 'Salah satu Seni Warisan Tradisional yang telah lama wujud di negeri Kelantan adalah Teater Tradisional Makyung iaitu melebihi 400 tahun. Teater Tradisional Makyung menggabungkan elemen nyanyian, tarian, muzik dan lakonan di dalam satu persembahan.\r\n\r\nPada semester September 2019/2020, Seni Persembahan UKP 10601 Makyung merupakan kelas pertama diperkenalkan di dalam subjek KoKurikulum. Sehubungan dengan itu, dengan adanya Karnival KoKurikulum ini dapat memberi peluang kepada pelajar - pelajar yang terlibat dan pelajar subjek lain untuk lebih mengenali struktur persembahan Teater Tradisional Makyung.', '', 'Pelajar UKP 10601 Makyung dan tetamu yang hadir program Karnival KoKurikulum UMK 2019', '', '700.00', '690.00', 'Noor Amiera Saila Binti Ramlee', '850806036004', '03036020347826', 'BIMB', 'amiera@umk.edu.my', 0, '2019-10-29', '2019-10-31', 0, 0, '', '2019-11-04', '2019-09-10 18:55:32', '0000-00-00 00:00:00', '2019-10-31 15:42:01', 'UMK.B01.03.03/700-8/1/1 JLD 2(15)', '0000-00-00', '08', 30),
(27, 201920201, 'PERSEMBAHAN MUZIK WAYANG KULIT', '04FD60', 241, 0, '2019-09-10', '2019-09-10', 'Dewan Keusahawanan, UMK Kampus Kota', '', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon kelulusan peruntukan daripada Pusat Ko-Kurikulum bagi Cadangan Mengadakan Persembahan Muzik Wayang Kulit sempena Karnival KoKurikulum 2019', 'Kursus UKP 10801 Wayang Kulit di perkenalkan di Universiti Malaysia Kelantan adalah untuk memberi pendedahan kepada mahasiswa/siswi mengenali dan mempelajari seni persembahan ini agar tidak dilupakan. Ini adalah kali pertama Kursus UKP 10801 Wayang Kulit menyertai Karnival KoKurikulum anjuran Pusat KoKurikulum.', '', 'Pelajar UKP 10801 Wayang Kulit dan peserta Karnival KoKurikulum 2019', '', '680.00', '684.00', 'WAN MOHD AZMI BIN WAN ABDUL RAHMAN', '840218035903', '03027020489875', 'BIMB', 'thedalangpuppet@gmail.com', 0, '2019-10-31', '2019-10-31', 0, 0, '', '2019-11-04', '2019-09-10 18:59:16', '0000-00-00 00:00:00', '2019-10-31 15:41:31', 'UMK.B01.03.03/700-8/1/1 JLD 2(16)', '0000-00-00', '08', 30),
(28, 201920201, 'KEJOHANAN BOLA BALING TERTUTUP LK1 2019', '30GGFW', 263, 0, '2019-09-11', '2019-09-11', 'GELANGGANG FUTSAL  UNIVERSITI MALAYSIA KELANTAN, KAMPUS KOTA', 'Pusat Ko-Kurikulum UMK', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan Mengadakan Kejohanan Bola Baling bagi Kursus\r\nUSK 1051 (Bola Baling / LK1) (Ko-Kurikulum Berkredit) di Kampus Kota, Universiti Malaysia Kelantan (UMK)\r\n', 'Kejohanan Bola Baling merupakan salah satu aktiviti yang dirancang oleh Bola Baling LK1 untuk memenuhi sukatan pelajaran bola baling iaitu mengelolakan sebuah pertandingan. Ia bertujuan untuk menjalin dan merapatkan hubungan antara siswa dan siswi Universiti Malaysia Kelantan. Aktiviti ini secara tidak langsung mampu menyemai nilai-nilai murni seperti kerjasama antara ahli, perpaduan antara pelbagai kaum, sifat berdaya saing, berfikiran positif, dan bersatu padu.\r\n\r\nKesimpulannya, aktiviti pertandingan ini adalah satu aktiviti sihat yang menjana kepada perkembangan ilmu pengetahuan kepada semua siswa, siswi, dan guru Universiti Malaysia Kelantan terutamanya dalam psikologi dan sosiologi yang merangkumi aspek intelek, emosi, sosial, rohani, dan jasmani selaras dengan matlamat Pendidikan Negara iaitu melahirkan insan yang baik dan sempurna supaya dapat menjadi warga negara Malaysia yang seimbang.\r\n', '', 'Pelajar Kelab Bola Baling LK1', 'Tiada', '500.00', '500.00', '', '0', '', '', '', 0, '0000-00-00', '0000-00-00', 0, 0, '', '0000-00-00', '2019-09-11 17:20:44', '0000-00-00 00:00:00', '2019-10-22 17:38:23', '', '0000-00-00', '-', 0),
(29, 201920201, 'PERTANDINGAN KAWAD KAKI ANTARA PLATUN', 'VUDKDY', 269, 0, '2019-09-12', '2019-09-12', 'UNIVERSITI MALAYSIA KELANTAN KAMPUS JELI', '', 'Penilaian akan pembelajaran dan pengetahuan akan asas kawad kaki\r\n\r\nMembentuk keseragaman dan kerjasama antara pasukan\r\n\r\n\r\n\r\n', 'Pasukan Askar Wataniah UMK Kampus Jeli telah menerima pelatih baharu seramai 64 orang dan telah mempunyai 39 anggota lama.\r\n\r\nPasukan Askar Wataniah UMK telah lama bermula 2008 lagi dan telah mengikuti pelbagai aktiviti yang melibatkan universiti mahupun aktiviti luar universiti.', '', 'pasukan askar wataniah kampus jeli', 'rejimen 506 askar wataniah', '1020.00', '950.00', 'MUHAMAD AZAM BIN KASERI', '920514035561', '03081020288114', 'BIMB', 'azam.k@umk.edu.my', 389, '2019-11-20', '2019-11-20', 0, 0, '', '2019-11-24', '2019-09-12 22:42:04', '0000-00-00 00:00:00', '2019-11-20 09:13:50', 'UMK.B01.03.03.700-8/1/1 JLD 2(37)', '0000-00-00', '08', 30),
(30, 201920201, '‘KESENIAN MEWARNAI BUDAYA MASYARAKAT’\r\n', 'BFTOSY', 306, 0, '2019-09-13', '2019-09-13', 'DEWAN KEUSAHAWANAN PENGKALAN CHEPA UNIVERSITI MALAYSIA KELANTAN  ', 'MELIBATKAN TIGA KAMPUS JELI BACHOK DAN PC', 'Program Kokurikulum Kesenian dan Kebudayaan Universiti Malaysia Kelantan', '2.1 Bahagian Kesenian dan Kebudayaan merupakan salah satu bahagian di bawah naungan Majlis Eksekutif Pelajar Universiti Malaysia Kelantan. Bahagian ini diberi tanggungjawab untuk memartabatkan dan memberi pendedahan mengenai aktiviti Kesenian dan Kebudayaan universiti agar dapat merapatkan hubungan sesama mahasiswa/i tanpa mengira kaum.\r\n2.2 Oleh yang demikian, Bahagian Kesenian dan Kebudayaan Universiti Malaysia     Kelantan ingin mengadakan program Kokurikulum Kesenian dan Kebudayaan Universiti Malaysia Kelantan. Program ini merupakan program yang dilakukan pada setiap tahun di Dewan Keusahawanan Pengkalan Chepa Universiti Malaysia Kelantan. \r\n2.3 Program ini bertujuan memupuk semangat kerjasama dalam kalangan pelajar universiti \r\nserta mengeratkan hubungan antara satu sama lain. \r\n\r\n', '', 'PELAJAR', 'JASTERA ENTERTAINMENT', '500.00', '1105.00', 'NURDHIYA SYAHIRAH BINTI ARIS', '910402016148', '7621405061', 'CIMB', 'chimary_es@yahoo.com', 484, '2019-11-21', '2019-11-21', 0, 0, '', '2019-11-24', '2019-09-14 00:49:39', '0000-00-00 00:00:00', '2019-11-21 00:31:59', 'UMK.B01.03.03.700-8/1/1 JLD 2(51)', '0000-00-00', '08', 30),
(31, 201920201, 'Program Glow Fun Run', 'QFK3KF', 232, 0, '2019-09-15', '2019-09-15', 'Astaka Universiti Malaysia Kelantan (UMK), Kampus Bachok', '', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan  kelulusan   peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan Mengadakan Program Glow Fun Run bagi Kursus UKD1011 Pengurusan Organisasi (LB2) (Ko-Kurikulum Berkredit) di Kampus Bachok, Universiti Malaysia Kelantan (UMK) pada tahun 2019.', 'Program ini diadakan bagi tujuan untuk menyemarakkan semangat perpaduan dalam kalangan pelajar melalui aktiviti bersukan. Justeru itu, UKD1011 Pengurusan Organisasi (LB2) bercadang untuk mengadakan satu acara larian santai pada waktu malam yang melibatkan pelajar Universiti Malaysia Kelantan. Aktiviti ini mampu membangkitkan semangat kesukanan dalam kalangan para mahasiswa di Universiti Malaysia Kelantan (UMK). Program Glow Fun Run ini juga dapat memupuk semangat cintai Universiti Malaysia Kelantan (UMK) kerana acara ini akan meliputi secara keseluruhan laluan di dalam universiti. Setiap peserta yang menyertai akan melakukan beberapa aktiviti lain yang mana ianya dapat memupuk semangat kerjasama antara peserta dan ahli jawatankuasa. \r\n', '', 'Pelajar Universiti Malaysia Kelantan (UMK)', '', '3250.00', '354.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-15 08:41:58', '0000-00-00 00:00:00', '2019-10-22 08:12:18', '', '0000-00-00', '-', 20),
(32, 201920201, 'Pameran Kelengkapan Angkatan Pertahanan Awam', 'LDV069', 260, 0, '2019-09-15', '2019-09-15', 'Padang Kawad Kampus Bachok', 'Angkatan Pertahanan Awam Daerah Bachok', 'Kerja kerja ini disediakan bertujuan untuk mendapat kelulusan dan bajet bagi melaksanakan program pameran KOR-SISPA semperna karnival kokurikulum 2019. Program ini akan memberi pendedahan kepada pengungjung pameran tentang kelengkapan dan kekuatan APM daerah Bachok. Semoga dengan adanya program karnival kokurikulum ini, minat pelajar semakin bertambah dalam pembelajaran mereka. Adalah diharapkan KOR-SISPA UMK kampus Bachok berkembang dan memberi menafaat kepada komuniti. \r\n\r\n', 'Penubuhan KOR-SISPA di UMK sebagai kursus kokurikulum adalah bertujuan untuk meperkasakan soft skill di kalangan pelajar. Kursus pasukan beruniform ini dapat memberi nilai tambahan kepada pelajar dari segi soft skill. Di samping penekanan kepada pencapaian akedemik yang cemerlang. Secara spesifiknya kemahiran yang dapat diterapkan melalui kokurikulum KOR-SISPA ini ialah semangat kerja berpasukan, memupuk nilai jati diri dan cintakan kepada tanah air. \r\nPameran yang dilaksanakan memberi pendedahan kepada pelajar dan komuniti tentang keupayaan APM dalam melaksanakan misi-misi menyelamat. ', '', 'Pelajar KOR-SISPA', '', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-15 12:16:58', '0000-00-00 00:00:00', '2019-11-11 12:35:52', '', '0000-00-00', '-', 20),
(33, 201920201, 'Persembahan Koir UKP1021  ', 'DBZH96', 236, 0, '2019-09-17', '2019-09-17', ' Dewan Keusahawanan UMK , Kampus Kota', '', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada Pusat Ko-Kurikulum ,Pejabat Hal Ehwal Pelajar bagi cadangan mengadakan persembahan tenis bagi Kursus UKP1021 ( Ko-Kurikulum Berkredit ) yang bertempat di Dewan Keusahawanan UMK, Kampus Kota.', 'Berperanan untuk mengasah bakat dan memberi pengalaman baru kepada pelajar yang terlibat. Sekali gus , melatih pelajar untuk tampil lebih berani dan bersemangat di khalayak ramai.', '', 'Mahasiswa dan Mahasiswi UMK', '', '860.00', '0.00', '', '0', '', '', '', 0, '2019-10-27', '0000-00-00', 0, 0, '', '0000-00-00', '2019-09-17 11:14:06', '0000-00-00 00:00:00', '2019-10-23 14:55:17', '', '0000-00-00', '-', 10),
(34, 201920201, 'PAMERAN DAN DEMONTRASI PERTOLONGAN CEMAS', '2SRS4F', 245, 0, '2019-09-17', '2019-09-17', 'UMK KAMPUS KOTA', 'ANGKATAN PERTAHANAN AWAM DAERAH KOTA BHARU', 'ANGKATAN PERTAHANAN AWAM ADALAH SEBUAH AGENSI BADAN BERUNIFORM YANG BERTINDAK MENYELAMAT NYAWA DAN JUGA MELINDUNGI HARTA BENDA ORANG AWAM SAMADA DI AMBIL SEBELUM, SEMASA DAN SELEPAS SESUATU BENCANA. SEHUBUNGAN DENDAN ITU, MELALUI KARNIVAL KOKURIKULUM PADA 26 NOVEMBER 2019 (SELASA) BERTEMPAT DI KAMPUS KOTA DAPAT DIAMBIL PELUANG UNTUK MENYAMPAIKAN MAKLUMAT DAN PERANAN ANGKATAN PERTAHANAN AWAM SELARAS DENGAN PENYERTAAN MAHASISWA DAN MAHASISWI DALAM SISPA', 'KURSUS UKV10202 (LK1) SISPA ADALAH SATU USAHA MEMBANTU PELAJAR MAHASISWA DAN MAHASISWI DALAM PENERAPAN KESUKARELAAN DAN MEMPELAJARI ILMU-ILMU ASAS DAN KEMAHIRAN DALAM ANGKATAN PERTAHANAN AWAM MALAYSIA MELALUI TEORI MAHUPUN PRAKTIKAL. PENUBUHAN UKV10202 (LK1) SISPA PERLU DIGUNAKAN DAN AMBIL PELUANG OLEH PELAJAR DALAM MENDIDIK DAN MEMBENTUK SAHSIAH DIRI DALAM SEGALA ASPEK TERUTAMANYA DALAM MENANGANI SITUASA KECEMASAN DAN JUGA BENCANA. SALURAN ANGKATAN PERTAHANAN AWAM DALAM USAHA MENYAMPAIKAN MAKLUMAT DAN MEMBERI PENDEDAHAN KEPADA MASYARAKAT JUGA MELALUI MEDIA ELEKTRONIK, PAMERAN DAN JUGA DALAM BENTUK DEMONTRASI. ', '', 'SEMUA KAKITANGAN UMK KAMPUS KOTA, PELAJAR DAN ORANG AWAM', 'ANGKATAN PERTAHANAN AWAM DAERAH KOTA BHARU', '0.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '0000-00-00', 0, 0, '', '0000-00-00', '2019-09-17 12:07:04', '0000-00-00 00:00:00', '2019-10-24 13:45:41', '', '0000-00-00', '-', 10),
(35, 201920201, 'Program Kejohanan Badminton Tertutup UMK Bagi Kursus Uks1041 (Badminton), Kelas LK2 (Ko-Kurikulum Berkredit) Di Kampus Kota, Universiti Malaysia Kelantan', 'FQYS43', 272, 0, '2019-09-17', '2019-09-17', 'Dewan Badminton Tengku Anis', 'Pusat Kokurikulum Universiti Malaysia Kelantan', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan  kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan Mengadakan Cadangan Mengadakan Kejohanan Badminton Tertutup UMK bagi Kursus UKS 1041 (Ko-Kurikulum Berkredit), di Kampus Kota, Universiti Malaysia Kelantan (UMK). ', 'Kejohanan Badminton Tertutup UMK yang akan diadakan ini untuk memupuk semangat kesukanan dalam kalangan mahasiswa dan mahasiswi supaya melibatkan diri dalam bidang kokurikulum bukan sahaja dalam bidang akademik semata-mata. Kejohanan ini juga bertujuan untuk mendidik mahasiswa dan mahasiswi mengenal erti pentingnya amalan gaya hidup sihat serta boleh merapatkan hubungan silaturrahim antara kaum.', '', 'Pelajar kelab badminton UKS 1041 LK2', '', '700.00', '864.30', 'WAN SUHAIMI BIN WAN SETAPA', '680414035759', '03036020118085', 'BIMB', 'wsuhaimiipg@gmail.com', 0, '2019-10-30', '2019-10-30', 0, 0, '', '2019-10-30', '2019-09-17 12:49:38', '0000-00-00 00:00:00', '2019-10-30 11:59:02', '', '0000-00-00', '08', 30),
(36, 201920201, '', 'D2BHVI', 294, 0, '2019-09-18', '2019-09-18', '', '', '', '', '', '', '', '0.00', '0.00', '', '0', '', '', '', 0, '0000-00-00', '0000-00-00', 0, 0, '', '0000-00-00', '2019-09-18 16:24:51', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '0000-00-00', '-', 0),
(37, 201920201, 'Kejohanan Bola Baling \"5 VS 5\" UMK 2019', '8B4F5W', 280, 0, '2019-09-21', '2019-09-21', 'Gelanggang C3 Futsal, Cabang 3 Melawi, Bachok', '', 'Penganjuran kejohanan adalah sebagai tugasan wajib pelajar UKS 1051 bagi menilai kebolehan dan keupayaan pengurusan dan penganjuran program. Selain itu dapat membantu mengasah bakat mahasiswa dalam bidang kepegawaian, kepengadilan dan juga dapat mencungkit bakat sukan dikalangan mahasiswa UMK, terutamanya dalam sukan bola baling. ', 'Permainan bola baling merupakan satu permaianan yang sedang meningkat naik dan merupakan antara sukan popular bukan sahaja di universiti-universti malah di peringkat kebangsaan. Penganjuran program ini adalah amat bertepatan dengan matlamat pendidikan negara kearah melahirkan insan yang seimbang dari segi intelek, emosi, jasmani dan sosial. Selain itu program ini juga diharapkan dapat mencungkil dan mengasah bakat mahasiswa UMK dalam permainan bola baling yang dapat diketengahkan ke peringkat yang lebih tinggi. \r\n\r\n', '', '40 orang peserta ', '', '500.00', '600.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-21 23:02:34', '0000-00-00 00:00:00', '2019-10-22 11:31:35', '', '0000-00-00', '-', 20),
(38, 201920201, 'Pementasan Teater LK1', '8TADJ2', 243, 0, '2019-09-22', '2019-09-22', 'UMK KAMPUS KOTA', '', 'Memenuhi penilaian Kursus Teater UKP1041 LK1 yang memerlukan perbelanjaan untuk mengadakan pementasan teater.', 'Kursus UKP1041 Teater (LK1) akan mengadakan pementasan teater yang akan dijadikan sebahagian penilaian. Semua pelajar yang mengikuti kursus ini akan terlibat secara langsung.', '', 'Pelajar Tahun Satu (yang mengikuti Kursus Teater UKP1041 LK1)', '', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-22 15:27:07', '0000-00-00 00:00:00', '2019-10-17 21:29:23', '', '0000-00-00', '-', 20),
(39, 201920201, 'Cadangan Mengadakan Pertandingan 11 Sebelah Tertutup Gabungan Kampus Kota Dan Kampus Jeli', 'ES8I1T', 321, 0, '2019-09-22', '2019-09-22', 'Padang IPG, Pengkalan Chepa', 'Kampus Kota Dan Kampus Jeli', 'Tujuan kertas kerja ini dikemukan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi cadangan mengadakan Pertandingan 11 SEBELAH Tertutup Gabungan Kampus Kota dan Kampus Jeli', 'Program ini bertujuan memberi ruang kepada pelajar untuk mempelajari cara untuk menguruskan satu pertandingan dan cara bermain dengan betul. Selain itu, program ini bukan sahaja mengajar pelajar untuk menguruskan satu pertandingan dalam sukan Bola Sepak malah menjadi satu platform bagi pelajar untuk mengeratkan silaturrahim antara 2 kampus.', '', 'Pelajar Kursus Bola Sepak UKS 1021', '', '500.00', '1000.00', '', '0', '', '', '', 0, '2019-10-27', '2019-11-10', 0, 0, '', '0000-00-00', '2019-09-22 15:55:41', '0000-00-00 00:00:00', '2019-11-10 23:58:23', '', '0000-00-00', '-', 20),
(40, 201920201, 'Kejohanan Bola Jaring LK2 2019', 'KTGF51', 317, 0, '2019-09-25', '2019-09-25', 'Gelanggang Bola Jaring UMK, Kampus Kota', '-', 'Kejohanan ini diadakan adalah untuk melihat nilai-nilai murni dan memupuk semangat kerja berpasukan antara pelajar melalui pengelolaan sesuatu aktiviti. Selain itu, hasil dari pengelolaan kejohanan ini juga, bakat terpendam pelajar sebagai seorang pemain bola jaring dapat diketengahkan dan sekaligus dapat digilap untuk mewakili Universiti Malaysia Kelantan ke kejohanan-kejohanan yang lebih besar.', 'Bola jaring merupakan sukan antarabangsa yang dimainkan oleh dua pasukan yang terdiri daripada tujuh pemain. Permainan ini melibatkan kemahiran asas seperti menghantar dan menerima bola, pergerakan, mengelak, menghadang dan menjaring. Melalui sukan bola jaring ini, ia dapat memupuk semangat kesukanan dan kerjasama antara ahli pasukan. Pengetahuan dalam teknik dan kemahiran bola jaring dapat melahirkan insan yang seimbang dari segi fizikal, emosi dan intelek.', '', 'Pelajar kursus bola jaring LK2', '-', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-25 09:10:29', '0000-00-00 00:00:00', '2019-10-22 14:37:56', '', '0000-00-00', '-', 20),
(41, 201920201, 'PERSEMBAHAN DAN PAMERAN REBANA KERCING', 'JDGLS3', 242, 0, '2019-09-26', '2019-09-26', 'DEWAN KEUSAHAWANAN UMK KAMPUS KOTA', 'Pusat KoKurikulum', 'Tujuan kertas kerja ini dikemukakan ialah untuk mendapat  kelulusan bagi mengadakan Persembahan dan pameran Rebana Kercing sempena karnival Kokurikulum UMk 2019', 'Kursus UKP10701 Rebana Kercing baru  di perkenalkan di Universiti Malaysia Kelantan adalah untuk memberi pendedahan kepada mahasiswa/siswi mengenali dan mempelajari seni persembahan ini agar tidak dilupakan.', '', 'Pelajar UKP 10701 Rebana Kercing dan peserta Karnival KoKurikulum 2019', '', '500.00', '460.00', 'MOHD HAZLAMI BIN HARUN', '900817035237', '153010509206', 'MAYBANK', 'mohdhazlamiharun@gmail.com', 0, '2019-10-31', '2019-11-04', 0, 0, '', '2019-11-05', '2019-09-26 09:58:55', '0000-00-00 00:00:00', '2019-11-04 17:34:25', 'UMK.B01.03.03/700-8/1/1 JLD 2(23)', '0000-00-00', '08', 30),
(42, 201920201, 'PERTANDINGAN KEJOHANAN SUKAN BOLA TAMPAR UKS 1013', 'ADRFLM', 286, 0, '2019-09-26', '2019-09-26', 'INSTITUSI PENDIDIKAN GURU KAMPUS KOTA BHARU', 'Kerjasama dengan pihak Kokurikulum', 'Kertas kerja ini dikemukakan bertujuan untuk memohon pertimbangan dan kelulusan Pengarah Pusat Kokurikulum bagi menganjurkan pertandingan kejohanan sukan bola tampar di institusi perguruan.', 'Kejohanan Bola Tampar merupakan salah satu aktiviti yang dirancang oleh mahasiswa dan mahasiwi UMK untuk memenuhi sukatan pelajaran iaitu mengelola sebuah pertandingan. Ia bertujuan untuk menjalin dan merapatkan hubungan antara mahasiswa dan mahasiswi UMK. Aktiviti ini secara tidak langsung mampu menyemai nilai-nilai murni seperti kerjasama antara ahli,perpaduan antara pelbagai kaum,berdaya saing,berfikiran positif dan bersatu padu.\r\n\r\nKesimpulannya,aktiviti perlawanan ini adalah salah satu aktiviti sihat yang menjana kepada semua mahasiswa dan mahasiswi UMK terutamanya dalam psikologi dan sosiologi yang merangkumi aspek intelek,emosi,sosial,rohani dan jasmani.\r\n', '', 'LK1', 'Tiada', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-09-26 11:05:13', '0000-00-00 00:00:00', '2019-10-24 01:20:09', '', '0000-00-00', '-', 20),
(43, 201920201, 'PERSEMBAHAN DIKIR BARAT SEMPENA KARNIVAL KOKURIKULUM UMK 2019', 'GF3D9Y', 323, 0, '2019-09-27', '2019-09-27', 'DEWAN KEUSAHAWANAN UMK KAMPUS KOTA', '', 'Tujuan kertas kerja ini dikemukakan ialah untuk mendapat kelulusan berhubung cadangan mengadakan Persembahan Dikir Barat sempena Karnival Kokurikulum Universiti Malaysia Kelantan 2019.\r\n\r\n', 'Dikir Barat ini merupakan persembahan kesenian Kelantan yang menjadi kebanggaan rakyat di Negeri Kelantan. Dikir Barat  UKP10501 baru sahaja diperkenalkan di UMK Kampus Kota. Ini merupakan kali pertama mereka menyertai dan mengadakan persembahan Dikir Barat setelah menjalani latihan mingguan.', '', 'Pelajar Seni Persembahan UKP 10501 Dikir Barat dan tetamu yang hadir program Karnival KoKurikulum 2019', '', '500.00', '500.00', 'WAN MUHAMMAD IBRAHIM BIN WAN ISMAIL', '900622035077', '153131070911', 'MAYBANK', 'rintingmas9009@gmail.com', 0, '2019-11-03', '2019-11-03', 0, 0, '', '2019-11-04', '2019-09-28 02:23:54', '0000-00-00 00:00:00', '2019-11-03 16:24:04', 'UMK.B01.03.03/700-8/1/1 JLD 2(17)', '0000-00-00', '08', 30),
(44, 201920201, 'PERSEMBAHAN DIKIR BARAT SEMPENA KARNIVAL KOKURIKULUM UMK 2019', 'ULOLS8', 313, 0, '2019-09-27', '2019-09-27', 'Laman Permai, FTKW, UMK Bachok', '', 'Tujuan kertas kerja ini dikemukakan ialah untuk mendapat  kelulusan berhubung cadangan mengadakan persembahan Dikir Barat sempena Karnival KoKurikulum UMK 2019', 'Dikir Barat ini merupakan persembahan kesenian Kelantan yang menjadi kebanggaan rakyat Kelantan.\r\n\r\nDikir Barat UKP10501 baru sahaja diperkenalkan di UMK Bachok. ini merupakan kali pertama mereka menyertai dan mengadakan persembahan Dikir Barat setelah menjalani latihan mingguan. ', '', 'Pelajar Seni Persembahan UKP 10501 Dikir Barat dan tetamu yang hadir program Karnival KoKurikulum 2019', '', '500.00', '500.00', 'MOHAMAD ZAINURI BIN MOHD ZIN', '890216035091', '7614049449', 'CIMB', 'zainurizin@gmail.com', 0, '2019-11-03', '2019-11-03', 0, 0, '', '2019-11-04', '2019-09-28 03:05:13', '0000-00-00 00:00:00', '2019-11-03 16:00:08', 'UMK.B01.03.03/700-8/1/1 JLD 2(18)', '0000-00-00', '08', 30),
(45, 201920201, 'Cadangan Mengadakan Persembahan Koir LK2 Bagi Kursus UKP 1021 Koir \r\nKo-Kurikulum Berkredit Pada Hari Karnival Ko-Kurikulum Universiti Malaysia Kelantan', 'KE64MS', 253, 0, '2019-09-29', '2019-09-29', 'Dewan Besar UMK Kota', 'Kumpulan2 Ko-Kurikulum Seni Persembahan lain di Kampus Kota', 'Persembahan Koir ini dapat meningkatkan pengetahuan dan kemahiran dalam bidang nyanyian, pengurusan koir dan memberikan pendedahan awal kepada mahasiswa dan mahasiswi tentang cara2  mewujudkan kumpulan koir yang mantap.\r\nPersembahan Koir juga akan mengeratkan silaturahim antara mahasiswa dan mahasiswi dan mewujudkan persefahaman melalui tugasan bersama dikalangan siswa-siswi dalam kumpulan tanpa mengira kaum.\r\n', 'Penglibatan dalam aktiviti kokurikulum adalah sangat penting bagi melahirkan mahasiswa yang proaktif dan berdaya saing dalam menguruskan dan menyertai program dan kursus- kursus di universiti. Ia dapat membuktikan bahawa mahasiswa tersebut mampu melaksanakan tugas dan membimbing mahasiswa dan mahasiswi dalam meningkatkan semangat silaturahim dan semangat kesukanan. Ia juga membantu mahasiswa dan mahasiswi menonjolkan bakat mereka dalam kokurikulum Koir serta bersemangat melaksanakan tugasan berkumpulan dan solo secara professional dan secara positif.', '', 'Mahasiswa dan mahasiswi Koir LK2 bagi Kursus Koir UKP 1021 (Ko-Kurikulum Berkredit) di Kampus Kota Universiti Malaysia Kelantan (UMK).', 'Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar dan Alumni Universiti Malaysia Kelantan', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-11-14', 0, 0, '', '0000-00-00', '2019-09-29 12:27:50', '0000-00-00 00:00:00', '2019-11-14 09:43:24', '', '0000-00-00', '-', 20),
(46, 201920201, 'PEMENTASAN TEATER PAMAN DOBLANG SEMPENA PENILAIAN KURSUS (UKP1041B)', 'GO4B4D', 278, 0, '2019-09-30', '2019-09-30', 'LAMAN EKSPERIMENTAL, UNIVERSITI MALAYSIA KELANTAN', '', 'Tujuan kertas kerja ini ialah untuk makluman dan kelulusan Pengarah Pusat Kokurikulum tentang program \"Pementasan Teater Paman Doblang Sempena Penilaian Kursus\" yang akan diadakan pada 28 Disember 2019.', 'Pementasan Teater Paman Doblang Sempena Penilaian Kursus ini merupakan salah satu program yang dianjurkan oleh Kokurikulum teater untuk memenuhi perancangan tahunan Kokurikulum sepanjang tahun ini. Program ini secara tidak langsung dapat memberi ruang kerjasama antara pelajar dalam Kokurikulum teater bagi bersama-sama menjayakan program ini serta merapatkan lagi ukhwah antara pelajar teater. Idea program ini tercetus daripada hasil perbincangan bersama ahli kokurikulum teater dan pensyarah penasihat.\r\n', '', 'Pelajar UMK', '', '500.00', '500.00', 'ANDIKA AZIZ HUSSIN', '711113715231', '110077167379', 'MAYBANK', 'andika@umk.edu.my', 0, '2019-10-31', '2019-10-31', 0, 0, '', '2019-11-04', '2019-09-30 10:12:51', '0000-00-00 00:00:00', '2019-10-31 14:53:01', 'UMK.B01.03.03/700-8/1/1 JLD 2(19)', '0000-00-00', '08', 30);
