(47, 201920201, 'PING PONG TOURNAMENT 2019', '0N3V9T', 250, 0, '2019-09-30', '2019-09-30', 'ASTAKA UNIVERSITI MALAYSIA KELANTAN BACHOK', 'Staf, fasilitator dan Ahli Kelab Ping Pong 2019 UNIVERSITI MALAYSIA KELANTAN', '1.1 Tujuan kertas kerja ini ialah untuk pertimbangan dan kelulusan Timbalan Naib Canselor (HEPA) tentang cadangan untuk mengadakan PING PONG TOURAMENT 2019 pada 26 NOVEMBER 2019, bertempat di Universiti Malaysia Kelantan Bachok.', '2.1 Tujuan Ping Pong Tournament diadakan adalah melahirkan mahasiswa yang aktif dalam kegiatan sukan di samping mewujudkan suasana kampus yang lebih meriah dengan aktiviti-aktiviti yang dilaksanakan.\r\n2.2  Ping Pong Tournament juga bertujuan untuk memupuk gaya hidup yang sihat dalam jiwa mahasiswa di samping mencungkil bakat yang dimiliki oleh mahasiswa dalam bidang sukan\r\n\r\n', '', 'Pelajar Universiti Malaysia Kelantan', '', '15.00', '450.00', '', '0', '', '', '', 0, '2019-10-27', '0000-00-00', 0, 0, '', '0000-00-00', '2019-09-30 22:54:14', '0000-00-00 00:00:00', '2019-10-23 22:45:21', '', '0000-00-00', '-', 10),
(48, 201920201, 'Latihan Simulasi Kecemasan', 'ZODUS5', 252, 0, '2019-10-01', '2019-10-01', 'Perkarangan Universiti Malaysia Kelantan Kampus Kota', 'Bulan Sabit Merah Malaysia Negeri Kelantan.', 'Di akhir program ini diharapkan:\r\n1.  Pelajar dapat merancang, melaksana, memimpin program, bekerjasamadan mengambil peranan secara aktif dalam kumpulan.\r\n2.  Pelajar memperoleh pengetahuan dan kemahiran yang baru dan kemudiannya dapat dilaksanakan pada bila-bila masa.\r\n3.  Pelajar dapat menunjukkan kecaknaan terhadap kepentingan perkhidmatan kepada masyarakat luar.', '1.  Bulan Sabit Merah Malaysia merupakan subjek kokurikulum UKU 10702 Universiti Malaysia Kelantan yang berteraskan semangat kesukarelawan dan kerja amal serta melibatkan diri dalam pelbagai aktiviti kolej dan Universiti.\r\n2.  Ahli Jawatankuasa ingin mengadakan program ini supaya peserta dapat didedahkan tentang teknik pertolongan cemas yang betul dan lebih mendalam', '', 'Pelajar UKU10702-Bulan Sabit Merah Malaysia (BSMM) semester September Sesi 2019/2020', 'Tiada', '1520.00', '1428.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-10-01 09:08:16', '0000-00-00 00:00:00', '2019-10-20 15:50:39', '', '0000-00-00', '-', 20),
(49, 201920201, 'PERTANDINGAN KEJOHANAN SUKAN BOLA TAMPAR UKS 1031', 'S4I8OE', 283, 0, '2019-10-01', '2019-10-01', 'IPG KOTA BHARU', 'PIHAK PENGARAH PUSAT KOKURIKULUM ', 'kertas kerja ini dikemukakan bertujuan untuk memohon pertimbangan dan kelulusan pengarah pusat kokurikulum bagi menganjurkan pertandingan kejohanan sukan bola tampar di institusi penguruan kota bharu', 'bola tampar merupakan satu sukan olimpik dimana dua pasukan yang dipisahkan oleh satu jaring tinggi mengunakan tangan atau bahagian badan yang lain untuk memukul atau menampar sebijik bola melangkaui jaring kepada lawan. setiap pasukan yang mempunyai enam pemain dibenarkan memukul bola tersebut tiga kali berturut turut. mata dikira apabila bola jatuh ke gelannggang lawan. lawan melakukan kesalahan atau lawan gagal mengembalikan bola dengan betul.\r\n\r\nbola tampar merupakan satu sukan aktif. disebabkan banyak serangan memerlukan pemain menyentuh bola di atas jaring. kebolehan melompat ditekankan dalam permainan ini.\r\n\r\nsukan bola tampar di malaysia bermula sekitar tahun 1920-an di pulau pinang. ia dipopularkan oleg pelajar-pelajar yang baru pulang daripada universiti chi-nan, shanfhai, sebelum berkembang di selangor dan negeri negeri lain', '', 'BOLA TAMPAR UKS 1031 LK 2', 'TIADA', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '0000-00-00', 0, 0, '', '0000-00-00', '2019-10-01 11:49:44', '0000-00-00 00:00:00', '2019-10-16 22:53:45', '', '0000-00-00', '-', 10),
