(51, 201920201, 'Mengadakan Program Kejohanan Bola Tampar Bagi  Kokurikulum  (UKS1031 LB1)', 'K3RF44', 247, 0, '2019-10-01', '2019-10-01', 'Gelanggang Bola Tampar UMK Bachok', '', 'kertas kerja kejohanan bagi kelab kokurikulum bola tampar disediakan adalah bagi memohon kelulusan dari pengarah pusat kokurikulum iaitu Dr. Mohd Nazri bin Muhayiddin. Program ini merupakan sebuah kerjasama dari pihak kelab pengurusan organisasi serta kerjasama dari kelab bola tampar UMK dalam menjayakan sebuah program yang bercirikan kesukanan.', 'program ini diadakan adalah untuk meningkatkan kemahiran pelajar dalam menguruskan sesebuah program sejajar dengan objektif pembelajaran. Melalui program ini antara kemahiran yang dapat ditingkatkan ialah seperti kemahiran menguruskan ahli-ahli yang terlibat untuk menjayakan program ini. Disamping itu, program ini berhasrat untuk memupuk semangat kesukanan dalam diri setiap pelajar.', '', 'Semua pelajar kokurikulum bola tampar', 'Pusat kokurikulum Universiti Malaysia Kelantan', '1200.00', '510.00', '', '0', '', '', '', 0, '2019-10-27', '2019-11-10', 0, 0, '', '0000-00-00', '2019-10-01 13:35:21', '0000-00-00 00:00:00', '2019-11-10 22:24:49', '', '0000-00-00', '-', 20),
(52, 201920201, 'Perlawanan Persahabatan Antara Pelajar Kursus UKS 1011 (LK1)', 'AJJ2BY', 255, 0, '2019-10-01', '2019-10-01', 'UMK Kampus Kota', 'Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar', 'Tujuan Kertas Kerja ini dikemukakan adalah untuk meohon\r\npertimbangan dan klulusan Peruntukan daripada Pusat Ko-\r\nKurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan MengadakanPerlawanan Persahabatan Antara Pelajar bagi Kursus UKS 1011 (LK1) di Kampus Kota Universiti Malaysia Kelantan', 'Matlamat utama kami sebagai pelajar digalakkan untuk merebut peluang dalam pelbagai aktiviti sukan yang dianjurkan.  Hal ini kerana penglibatan diri dalam sesuatu aktiviti skan dapat membantu diri pelajar dalam kemahiran insaniah di masa akan datang.  Aktiviti ini secdara tidak langsung menyebabkan pelajar menperolehi ilmu tentang kemahiran mengendalikan sesuatu kejohanan.  Disamping itu ianya dapat memberi pengetahuan dan pengalaman kepada pelajar dalam bidang pengurusan.  Pengalaman, pengetahuan dan kemahiran pengurusan dapat diterapkan dan dpupuk dalam diri pelajar pada masa kini dan masa hadapan.', '', 'Pelajar Kursus Ko-Kurikulum UKS 1011, LK1', '', '570.00', '570.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-10-01 13:46:03', '0000-00-00 00:00:00', '2019-10-24 23:50:32', '', '0000-00-00', '-', 20),
(53, 201920201, 'Pertandingan Pertolongan Cemas & CPR ', 'E7944Y', 265, 0, '2019-10-01', '2019-10-01', 'Laman Monsun, UMK Kampus Bachok', 'Bulan Sabit Merah Malaysia Negeri Kelantan ', '1.1	Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan Mengadakan Pertandingan Pertolongan Cemas & CPR bagi Kursus UKU10702 - Bulan Sabit Merah Malaysia (Ko-Kurikulum Berkredit) di Universiti Malaysia Kelantan melibatkan pelajar Kampus Bachok.', '2.1	Bulan Sabit Merah Malaysia merupakan subjek kokurikulum UKU 10702 Universiti Malaysia Kelantan yang berteraskan semangat sukarelawan dan kerja amal serta melibatkan diri dalam pelbagai aktiviti kolej dan unversiti.\r\n2.2 	Ahli Jawatankuasa (AJK) ingin mengadakan program Latihan Simulasi Kecemasan di Universiti Malaysia Kelantan Kampus Bachok supaya peserta dapat didedahkan tentang teknik pertolongan cemas yang betul dan lebih mendalam.	\r\n', '', 'Pelajar UKU10702 - Bulan Sabit Merah Malaysia Semester September Sesi 2019/2020 seramai 31 orang ', '', '945.00', '790.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-10-01 15:05:48', '0000-00-00 00:00:00', '2019-10-17 16:06:46', '', '0000-00-00', '-', 20),
(54, 201920201, 'Pengurusan Karnival Kokurikulum', 'XE4FVS', 325, 0, '2019-10-01', '2019-10-01', 'Kampus Kota, Pengkalan Chepa', 'Pusat Ko-kurikulum Universiti Malaysia Kelantan', 'Kertas kerja ini bertujuan untuk memohon pertimbangan dan kelulusan daripada Pusat Ko-kurikulum, Pejabat Hal Ehwal Pelajar bagi melancarkan gerak kerja pengurusan bagi Karnival Kokurikulum yang akan dijalankan pada 26 November 2019 ini.', 'Karnival Kokurikulum merupakan satu program yang diadakan sebagai satu kesinambungan dari aktiviti kokurikulum mingguan yang dijalankan di Universiti Malaysia Kelantan. Ia bertujuan menggalakkan mahasiswa aktif dalam bidang kokurikulum disamping memberi ruang kepada mereka menimba ilmu menerusi pengalaman sebanyak mungkin sepanjang program dijalankan. Selain itu, mendedahkan pelajar dengan aktiviti urusniaga bagi menjana pendapatan. Program ini bekerjasama dengan pusat Ko-kurikulum Universiti Malaysia Kelantan.', '', 'Pelajar Universiti Malaysia Kelantan Kampus Kota', '', '1000.00', '440.00', 'MAYSARAH BINTI MOHD DRUS', '2147483647', '12029020772930', 'BIMB', 'maysarah240493@gmail.com', 0, '2019-10-27', '2019-10-29', 0, 0, '', '0000-00-00', '2019-10-01 15:17:57', '0000-00-00 00:00:00', '2019-10-29 14:45:18', '', '0000-00-00', '-', 20),
