(56, 201920201, 'Pementasan Teater Rahsia Banglo Usang ', 'DD94DG', 288, 0, '2019-10-01', '2019-10-01', 'Dewan Terbuka Keusahawanan Universiti Malaysia Kelantan', 'Pusat Kokurikulum Universiti Malaysia Kelantan Kampus Kota', 'Pementasan ini merupakan pementasan akhir pelajar-pelajar UKP1041 Teater LK2.', 'Pelajar-pelajar UKP1041 Teater di bawah tenaga pengajar Mohd Wahidi Ab. Rahim. Aktiviti kokurikulum bagi teater ini telah dijalankan selama 4 bulan. Penilaian akhir dibuat dengan cara pementasan akhir teater bagi mengcungkil bakat pelajar-pelajar UKP1041 Teater LK2.', '', 'Pelajar-pelajar UKP1041 Teater LK2', 'Tiada Berkaitan', '0.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '0000-00-00', 0, 0, '', '0000-00-00', '2019-10-02 00:44:25', '0000-00-00 00:00:00', '2019-10-17 00:26:12', '', '0000-00-00', '-', 10),
(57, 201920201, 'Karnival Kokurikulum Universiti Malaysia Kelantan.\r\n(Bola Baling UKS 1051 LB2 Semester September 2019/2020)', 'LS2GFU', 282, 0, '2019-10-02', '2019-10-02', 'Gelanggang Futsal C3, Melawi, Bachok, Kelantan', 'Pusat Kokurikulum UMK', '1. Memberi pendedahan kepada mahasiswa mengenai ilmu \r\n   pengurusan dan penganjuran program.\r\n\r\n2. Mengenalpasti, mencungkil dan menyerlahkan bakat para\r\n   mahasiswa dalam sukan bola baling.', '       Kejohanan bola baling merupakan salah satu aktiviti yang dirancang untuk memenuhi sukatan pelajaran bagi kursus UKS1051. Aktiviti ini mampu untuk menyemai nilai murni seperti kerjasama antara ahli, sifat berdaya saing, berfikiran positif dan bersatu padu.\r\n\r\n       Penganjuran program ini menjana kepada perkembangan ilmu pengetahuan kepada mahasiswa terutamanya psikologi dan jasmani selaras dengan matlamat Pendidikan Negara untuk melahirkan insan yang baik dan sempurna supaya menjadi warganegara Malaysia yang seimbang dari segi rohani, jasmani, intelek dan emosi.\r\n\r\n\r\n\r\n', '', 'Pelajar UKS1051 Bola Baling Kumpulan LB2 Semester September Sesi 2019/2020 seramai 40 orang', 'tiada', '700.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-10-02 09:53:14', '0000-00-00 00:00:00', '2019-10-22 10:29:32', '', '0000-00-00', '-', 20),
(58, 201920201, 'Pertandingan Petanque Tertutup UMK', '9KDG73', 275, 0, '2019-10-02', '2019-10-02', 'Gelanggang Petanque UMK Kampus Kota', 'Kelab Petanque UMK', 'Tujuan kertas kerja ini dikemukan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi cadangan mengadakan Pertandingan Petanque Tertutup bagi kursus Petanque (Ko-kurikulum Berkredit) di Kampus Kota, Universiti Malaysia Kelantan (UMK).', 'Program ini bertujuan memberi ruang kepada pelajar untuk mempelajari cara untuk meguruskan satu pertandingan dan cara bermain dengan betul. Selain itu, program ini bukan sahaja mengajar pelajar untuk meguruskan satu pertandingan dalam sukan Petanque malah menjadi satu platform bagi pelajar untuk mengeratkan silaturrahim serta berkongsi pendapat dalam menaikkan nama sukan Petanque ini.', '', 'Pelajar-Pelajar KKB', '', '500.00', '500.00', 'MAHATHIR BIN MUHAMAD', '820807035225', '03120020076481', 'BIMB', 'mahathir.m@umk.edu.my', 0, '2019-11-03', '2019-11-03', 0, 0, '', '2019-11-04', '2019-10-02 10:37:17', '0000-00-00 00:00:00', '2019-11-03 12:41:03', 'UMK.B01.03.03/700-8/1/1 JLD 2(20)', '0000-00-00', '08', 30),
(59, 201920201, 'PERTANDINGAN TENIS UKS 1081 KAMPUS JELI', '2R33DJ', 234, 0, '2019-10-02', '2019-10-02', 'GELANGGANG TENIS UMK', '', '1.1	Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan  kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi  cadangan mengadakan pertandingan tenis bagi Kursus UKS1081 (Ko-Kurikulum Berkredit) di gelanggang tenis UMK Kampus Jeli.', 'Memberikan ilmu pengetahuan dan pengalaman baru kepada semua pelajar yang terlibat.  Melatih pelajar bagaimana cara mengurus dan menganjur sesuatu kejohanan.', '', 'Pelajar-pelajar ko kurikulum tenis kampus Jeli UKS 1081 (LJ 1)', '', '610.00', '610.00', '', '0', '', '', '', 0, '0000-00-00', '0000-00-00', 0, 0, '', '0000-00-00', '2019-10-02 10:58:03', '0000-00-00 00:00:00', '2019-10-16 11:18:00', '', '0000-00-00', '-', 0),
(60, 201920201, 'Cabaran Jejak Maklumat \r\nPengucapan Awam', 'M32MDI', 251, 0, '2019-10-02', '2019-10-02', 'Sekitar UMK Pengkalan Chepa', '', ' Melahirkan pelajar yang mempunyai pelbagai pengetahuan yang sesuai dalam bidang pengucapan awam\r\n', 'Aktiviti Jejak Maklumat Pengucapan Awam ini adalah aktiviti luar bilik darjah di mana ia menguji kemahiran peserta bagi menyelesaikan tugasan yang diberi. Peserta dibahagikan kepada beberapa kumpulan dan dikehendaki untuk menjelajah dari satu ke satu stesen bagi menyempurnakan tugasan yang diberi. Sepanjang penjelajahan peserta akan diuji dengan ujian yang melibatkan minda, kecergasan dan ketahanan mental.', '', 'Penyertaan terbuka kepada semua pelajar UMK.', '', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-10-02 12:34:26', '0000-00-00 00:00:00', '2019-10-23 09:21:18', '', '0000-00-00', '-', 20),
(61, 201920201, 'KEJOHANAN BOLA BALING JUNIOR TERTUTUP UMK', '38GTV6', 304, 0, '2019-10-02', '2019-10-02', 'PADANG INSTITUT PENDIDIKAN GURU KAMPUS KOTA BHARU', 'Staf Institut Pendidikan Guru Kampus Kota Bharu', 'Kertas kerja ini dikemukan bertujuan memohon pertimbangan dan kelulusan Pengarah Pusat Pengajian Bahasa Dan Pembangunan Insaniah untuk menganjurkan Karnival Kokurikulum Bola Baling anjuran Kursus UKS 1051 (Bola Baling LK2) pada 26 November 2019 di Padang Institut Pendidikan Guru Kampus Kota Bharu.', 'Kejohanan ini dijalankan untuk memenuhi jam kredit dalam proforma Ko-Kurikulum bagi pelajar UMK semester satu.\r\nMenggalakkan para pelajar untuk mengaplikasikan semula kemahiran dan ilmu yang telah dipelajari melalui karnival kokurikulum bola baling ini.Melahirkan pelajar universiti yang aktif dari segi fizikal dan mental. Aktiviti ini menggalakkan pelajar agar seimbang dari segi pencapaian akademik dan kokurikulum.\r\n', '', 'Semua ahli kumpulan (LK1 dan LK2) bola baling dan semua pelajar tahun satu Universti Malaysia Kelantan.', 'Persatuan Bulan Sabit Merah Malaysia IPGKKB.', '845.00', '505.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-10-02 13:01:14', '0000-00-00 00:00:00', '2019-10-22 14:09:05', '', '0000-00-00', '-', 20),
(62, 201920201, 'Kejohanan Bola Jaring Semester 1, Universiti Malaysia Kelantan (UMK), Kampus Jeli.', '06US0D', 249, 0, '2019-10-02', '2019-10-02', 'Gelanggang Bola Jaring Kampus Jeli', 'Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar Universiti Malaysia Kelantan.', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar.', 'Pertandingan bola jaring ini diadakan adalah untuk menilai kepimpinan, pengurusan dan kerjasama di antara pelajar-pelajar di dalam kelas ini. Di samping itu juga, ianya adalah untuk menilai semua pelajar kelas ini dalam mengaplikasikan semua aspek kemahiran asas permainan dan juga kepengadilan bola jaring. Selain itu diharapkan pertandingan ini dapat mencungkil bakat-bakat baharu untuk pemilihan pemain bola jaring ke peringkat seterusnya.', '', '33 orang ahli Kelab Bola Jaring UKS 1011 dan terbuka kepada semua pelajar perempuan semester 1', '', '500.00', '500.00', '', '0', '', '', '', 0, '2019-10-27', '2019-10-27', 0, 0, '', '0000-00-00', '2019-10-02 16:01:17', '0000-00-00 00:00:00', '2019-10-22 13:24:01', '', '0000-00-00', '-', 20),
