(65, 201920201, 'KEJOHANAN SUKAN TENIS TERTUTUP PERINGKAT UNIVERSITI MALAYSIA KELANTAN', 'DGR88I', 273, 0, '2019-10-03', '2019-10-03', 'INSTITUT PENGAJIAN GURU KAMPUS KOTA BHARU', 'Pusat Kokurikulum Universiti Malaysia Kelantan', 'Kertas kerja ini dikemukakan untuk mendapatkan kelulusan menjalankan program \"Kejohanan Sukan Tenis Tertutup Peringkat UMK\" dan juga untuk mendapatkan dana daripada pusat kokurikulum Universiti Malaysia Kelantan', 'Program ini telah dirancang oleh Mahasiswa/i USK1081 Tenis dari kelas LK1 bagi menyempurnakan projek yang ditetapkan pada semester September 2019 ini\r\n\r\nProgram ini dirancang akan diadakan di sekitar kawasan Kelantan iaitu Institut Pengajian Guru (IPG) Kampus Kota Bharu sebagai kawasan utama sepanjang program tersebut dijalankan', '', 'Warga UMK', '', '715.00', '658.02', '', '0', '', '', '', 0, '0000-00-00', '0000-00-00', 0, 0, '', '0000-00-00', '2019-10-03 13:49:02', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '0000-00-00', '-', 0),
(66, 201920201, 'Get To Know You!', 'UOXIPH', 290, 0, '2019-10-06', '2019-10-06', 'K106D', '', 'Tujuan utama program ini dijalankan adalah untuk belajar mengenai psikologi dan meningkatkan keyakinan diri dengan kelebihan yang dimiliki', 'Projek ini dijalankan adalah untuk meningkatkan keyakinan yang ada dalam diri mahasiswa UMK', '', 'pelajar UMK', '', '700.00', '700.00', 'NIK ZULKAMAL BIN NIK HASSAN', '860407295585', '10043020130042', 'BIMB', 'zulkamal@umk.edu.my', 0, '2019-11-05', '2019-11-06', 0, 0, '', '2019-11-18', '2019-10-06 12:31:19', '0000-00-00 00:00:00', '2019-11-06 16:05:55', 'UMK.B01.03.03.700-8/1/1 JLD 2(39)', '0000-00-00', '08', 30),
(67, 201920201, 'Innovation And Action Youth Business Pitching', 'D331G1', 324, 0, '2019-10-06', '2019-10-06', 'Dewan Serbaguna Universiti Malaysia Kelantan Kampus Jeli', 'UMKEI ', 'Bagi menyemai dan memperkukuhkan atribut keusahawanan serta meningkatkan pencapaian syarikat pelajar sedia ada, satu aktiviti inovasi dalam penjanaan idea program keusahawanan pelajar dicadangkan iaitu program Innovation and Action Youth Business Pitching.\r\n', 'Youth Business Pitching Competition iaitu pertandingan business pitching dalam bentuk BMC di peringkat universiti dengan tema pertandingan ‘UMK lestari’. “Business Model\r\nCanvas” adalah strategi yang digunakan oleh sesebuah syarikat sebelum memulakan perniagaan. Antara perkara yang dijelaskan dalam “Business Model Canvas” adalah\r\nberhubungan dengan banyak aspek dalam sebuah perniagaan seperti hubungan dengan pembekal, dengan pengedar atau dengan para pelanggan secara langsung.\r\n“Business Model Canvas” membantu kita menemukan tujuan perniagaan secara jelas dan mendedahkan tentang sasaran apa yang harus dicapai terlebih dahulu bagi mendapatkan idea dan kaedah yang tepat dalam membangunkan perniagaan. Sehubungan dengan itu, objektif program ini adalah untuk menyediakan satu platform pembelajaran komunikasi efektif kepada peserta seterusnya menyampaikan keberkesanan komunikasi efektif itu dalam bentuk pertandingan.', '', 'Pelajar Kokurikulum Aksi Inovasi Dalam Keusahawanan INACT 1', 'MPC, KPDNHEP', '500.00', '490.00', 'MUHAMMAD AMIRUDDIN BIN WAHAB', '940514145187', '14069020395126', 'BIMB', 'amiruddinwahab94@gmail.com', 466, '2019-11-18', '2019-11-18', 0, 0, '', '2019-11-24', '2019-10-06 21:58:14', '0000-00-00 00:00:00', '2019-11-18 21:56:43', 'UMK.B01.03.03.700-8/1/1 JLD 2(52)', '0000-00-00', '08', 30),
(68, 201920201, 'PERSEMBAHAN TAEGEUK, PECAH PAPAN DAN TEKNIK MEMPERTAHANKAN DIRI UNTUK LELAKI DAN WANITA ', 'G98F5K', 319, 0, '2019-10-07', '2019-10-07', 'UMK KAMPUS KOTA', 'Kelab Sara TaeKwonDo Martial Art Negeri Kelantan', 'Persembahan Taegeuk adalah bertujuan memperlihatkan kesenian pergerakan asas dalam seni mempertahankan diri TaeKwonDo yang berasal dari Negara Korea.  Dalam pada itu teknik pecah papan dipersembahkan untuk memperlihatkan displin yang tinggi, ketangkasan, ketepatan d fokus terhadap target dalam seni mempertahankan diri ini.  Teknik mempertahankan diri untuk lelaki dan wanita turut dipersembahkan untuk menunjukkan kepentingan mempelajari seni mempertahankan diri sekiranya diserang oleh penjahat pada zaman yang mana peningkatan kadar jenayah adalah sangat membimbangkan.', 'Kelab Sara TaeKwondo Martial Art Negeri Kelantan yang mula diperkenalkan dalam kokurikulum UMK pada tahun ini (2019) merupakan salah satu daripada 19 Kelab Premier berprestij yang bernaung di bawah TaeKwonDo Malaysia WTF.  Dalam pada masa yang sama juga Kelab Sara TaeKwonDo Martial Art Negeri Kelantan merupakan Ahli Bersekutu  Persatuan TaeKwonDo Negeri Kelantan (TM/WTF). Menjadi syarat utama Kementerian Pendidikan Malaysia memberi kebenaran kepada ahli dan jurulatih bertauliah dan berdaftar dengan Badan Induk Persatuan sahaja untuk mengajar di sekolah-sekolah dan institusi pendidikan tinggi, pada amnya terdapat 177 kelab TaeKwonDo yang berada dibawah Persatuan TaeKwonDo Negeri Kelantan.   Master Manimaran A/L Sugomaran adalah merupakan jurulatih berpengalaman selama 36 tahun dalam arena sukan TaeKwonDo WTF.  Beliau merupakan \'Jurulatih Kesayangan Anak Melayu dan Cina\' (Utusan 25 Ogos 2019).  Beliau telah banyak menaikkan nama Negeri Kelantan di peringkat kebangsaan dan mengharumkan nama Malaysia dipersada antarabangsa dalam arena sukan TaeKwonDo WTF.   ', '', 'Pelajar UMK', '-Tiada-', '935.00', '935.00', '', '0', '', '', '', 0, '2019-10-27', '0000-00-00', 0, 0, '', '0000-00-00', '2019-10-07 12:08:06', '0000-00-00 00:00:00', '2019-10-17 16:18:20', '', '0000-00-00', '-', 10),
