(70, 201920201, 'Innovation And Action Youth Business Pitching', 'W2E4NK', 332, 0, '2019-10-07', '2019-10-07', 'Dewan Serbaguna Universiti Malaysia Kelantan', 'UMKEI', 'Bagi menyemai dan memperkukuhkan atribut keusahawanan serta meningkatkan pencapaian syarikat pelajar sedia ada, satu aktiviti inovasi dalam penjanaan idea program keusahawanan pelajar dicadangkan iaitu program Innovation and Action Youth Business Pitching.', 'Youth business pitching competition iaitu pertandingan Business pitching dalam bentuk BMC di peringkat universiti dengan tema pertandingan ‘UMK lestari’. “Business Model Canvas” adalah strategi yang digunakan oleh sesebuah syarikat sebelum memulakan perniagaan. Antara perkara yang dijelaskan dalam “Business Model Canvas” adalah berhubungan dengan pelbagai aspek dalam sebuah perniagaan seperti hubungan dengan pembekal, dengan pengedar atau dengan para pelanggan secara langsung. “Business Model Canvas” membantu kita menemukan tujuan perniagaan secara jelas dan mendedahkan tentang sasaran apa yang harus dicapai terlebih dahulu bagi mendapatkan idea dan kaedah yang tepat dalam membangunkan perniagaan. Sehubungan dengan itu, objektif program ini adalah untuk menyediakan satu platform pembelajaran komunikasi efektif kepada peserta seterusnya menyampaikan keberkesanan komunikasi efektif itu dalam bentuk pertandingan.', '', 'Pelajar kokurikulum inovasi dan aksi dalam keusahawanan INACT 1', 'MPC, KPDNHEP', '500.00', '490.00', 'Muhammad Aiman Bin Adam', '940115115263', '01117020083783', 'BIMB', 'aiman.adam9415@yahoo.com', 472, '2019-11-19', '2019-11-19', 0, 0, '', '2019-11-24', '2019-10-07 20:24:57', '0000-00-00 00:00:00', '2019-11-19 00:12:46', 'UMK.B01.03.03.700-8/1/1 JLD 2(53)', '0000-00-00', '08', 30),
(71, 201920201, 'KERTAS KERJA JAWATANKUASA KOKURIKULUM PINGPONG (UKS 11101) CADANGAN MENGADAKAN PROGRAM KEJOHANAN PINGPONG TERBUKA (NOVICE BEGINNER LELAKI DAN PEREMPUAN & NOVICE JUNIOR) PERINGKAT NEGERI KELANTAN', '4JF8OX', 256, 0, '2019-10-07', '2019-10-07', 'DEWAN TERBUKA KEUSAHAWANAN UNIVERSITI MALAYSIA KELANTAN', 'Pusat Ko-kurikulum Universiti Malaysia Kelantan', 'Kertas Kerja \"KEJOHANAN PINGPONG TERBUKA PERINGKAT UNIVERSITI MALAYSIA KELANTAN\" ini disediakan adalah bagi memohon kelulusan dari Pengarah  Pusat Kokurikulum iaitu Dr. Mohd Nazri Bin Muhayiddin.Program ini merupakan sebuahn kerjasama dari pihak Kelab Pengurusan Organisasi serta dari Kelab Pingpong Universiti Malaysia Kelantan dalam menjayakan sebuah program yang bercirikan kesukanan. Selain itu, program ini dilaksanakan bagi memberikan pendedahan kepada pelajar tahun satu daripada LK1 dan LK2 tentang menguruskan sesebuah program di peringkat Universiti. Program ini berhasrat supaya pelajar dapat didedahkan dengan pengaplikasian semangat kesukanan,kerjasama antara pasukan dan kepentingan kecergasan diri bagi setiap individu.  ', 'Program ini diadakan adalah untuk meningkatkan kemahiran pelajar dalam menguruskan sesebuah program sejajar dengan objektif pembelajaran. Melalui program ini,antara kemahiran menuguruskan ahli-ahli yang terlibat untuk menjayakan program. Selain itu, pelajar dapat meningkatkan kemahiran berkomunikasi antara pihak berkepentingan bagi merealisasikan matlamat program ini. Pelajar juga dapat belajar tentang pentingnya kerjasama antara kumpulan dalam merealisasikan sesuatu program. Disamping itu, program ini berhasrat untuk memupuk semangat kesukanan dalam diri pelajar. Hal ini juga dapat mendedahkan betapa pentingnya sukan dalam menjana kecergasan diri,mental dan fizikal. Sehubungan dengan itu, usaha untuk meningkatkan kesedaran orang ramai agar bersukan. Diharapkan program ini dapat memberikan manfaat yang berguna kepada semua pihak terutama mahasiswa UMik amnya dan pelajar yang terlibat khususnya. Dengan itu, segala kerjasama dan sokongan sama ada secara langsung atau tidak langsung amatlah diharapkan. Sesungguhnya hasrat murni dapat merealisasikan matlamat program ini hanya Allah S.W.T sahaja yang mampu.', '', 'Terbuka Kelantan', 'ANJURAN KOKURIKULUM PINGPONG LK1,LK2,LB1 DAN PENGURUSAN ORGANISASI LK1', '3200.00', '1000.00', '', '0', '', '', '', 0, '2019-10-27', '0000-00-00', 0, 0, '', '0000-00-00', '2019-10-07 21:56:07', '0000-00-00 00:00:00', '2019-10-22 20:54:30', '', '0000-00-00', '-', 10),
(72, 201920201, 'CADANGAN MENGADAKAN \r\nPAMERAN FOTOGRAFI SEMPENA KARNIVAL KOKURIKULUM ', '375389', 264, 0, '2019-10-08', '2019-10-08', 'Universiti Malaysia Kelantan, Kampus Kota, Pengkalan Chepa, 16100 Kota Bharu', '', 'Kertas kerja ini diadakan bagi memohon kelulusan dari YBhg. Timbalan Naib Canselor, Hal Ehwal Pelajar dan Alumni (HEPA) Univesiti Malaysia Kelantan untuk mengadakan program \"PAMERAN FOTOGRAFI SEMPENA KARNIVAL KOKURIKULUM\" yang akan diadakan pada 26 November 2019', '1. Memberi pendedahan tentang aktiviti fotografi semesta September sesi 2019/2020 bagi kedua-dua kelas dibawah kelas fotografi supaya jalinan antara kedua-dua kelas tidak terputus hubungan.\r\n\r\n2. Memberi peluang bagi setiap kelas berkongsi kelebihan dan pengalaman mereka dan mengaplikasikan di dalam setiap aktiviti yang diberi.\r\n\r\n3. Memberi impak positif dalam diri peserta supaya lebih cekap untuk menghadapi pelbagai situasi serta melahirkan sikap kepimpinan dalam diri agar dapat membantu mahsiswa di Universiti untuk yakin dalam apa jua situasi\r\n', '', 'Mahasiswa UMK Kampus Kota', '', '1700.00', '1700.00', 'Dominic Lim Yi Wei', '990628045091', '01078024330560', 'BIMB', 'dominic_0628@yahoo.com', 0, '2019-11-05', '2019-11-05', 0, 0, '', '2019-11-06', '2019-10-08 11:45:29', '0000-00-00 00:00:00', '2019-11-05 00:20:48', 'UMK.B01.03.03/700-8/1/1 JLD 2(27)', '0000-00-00', '08', 30),
