(74, 201920201, 'PERSEMBAHAN GAMELAN UKP1011 KAMPUS KOTA', 'WIBV48', 254, 0, '2019-10-08', '2019-10-08', 'DEWAN KEUSAHAWANAN KAMPUS KOTA', ' tiada', 'Tujuan kertas kerja ini dikemukan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat  Hal Ehwal Pelajar bagi cadangan untuk mengadakan persembahan Gamelan bagi meningkatkan skil para pelajar Kursus UKP 1011 ( Ko-Kurikulum Berkredit)  di Dewan Keusahawanan UMK Kampus Kota', 'Penganjuran program ini merupakan salah satu proses pembelajaran para pelajar untuk meningkatkan kemahiran bermain gamelan di khalayak orang ramai dan juga memberi satu ilmu pengetahuan dan pengalaman baru kepada semua pengkursus yang melibatkan diri dalam UKP1011 (gamelan)', '', 'Pelajar yang mengikuti kursus UKP1011 (gamelan)', 'Unit HEP UMK', '500.00', '475.00', 'NURUL AFIQAH BINTI AB MUTALIB', '980124016706', '154035569175', 'MAYBANK', 'afiqahmutalib241@GMAIL.COM', 477, '2019-11-20', '0000-00-00', 0, 0, '', '0000-00-00', '2019-10-08 15:14:52', '0000-00-00 00:00:00', '2019-11-20 10:04:21', '', '0000-00-00', '-', 10),
(75, 201920201, 'CADANGAN MENGADAKAN KAWAD KAKI DAN KAWAD TEMPUR', '1PGDD7', 318, 0, '2019-10-08', '2019-10-08', 'UMK BACHOK', '-', 'MEMPELAJARI TEKNIK PERGERAKAN KAKI DAN TANGAN DENGAN TEPAT, SERTA DAPAT MENDISIPLINKAN DIRI.', 'BERKAWAD ADALAH ASAS UNTUK MEMBENTUK TATATERTIB DALAM PASUKAN. BERTUJUAN UNTUK MEMBENTUK SESEORANG AHLI YANG MEMPUNYAI TAHAP DISIPLIN YANG TINGGI, CERGAS DAN TAAT PERINTAH. DI SAMPING DAPAT MELAHIRKAN MODAL INSAN YANG MAMPAN.', '', 'UKU10602 WATANIAH (LK1) September 2019/2020', '-', '500.00', '500.00', 'MOHD LOKMAN BIN SUHAIMIN', '820507035063', '03018020695388', 'BIMB', 'lokman@umk.edu.my', 0, '2019-11-05', '2019-11-06', 0, 0, '', '2019-11-06', '2019-10-08 17:20:20', '0000-00-00 00:00:00', '2019-11-06 11:38:58', 'UMK.B01.03.03/700-8/1/1 JLD 2(28)', '0000-00-00', '08', 30),
