(77, 201920201, 'TAEKWONDO PERSEMBAHAN SENI PERTAHANKAN DIRI SERTA PECAH PAPAN', 'SSAF79', 327, 0, '2019-10-09', '2019-10-09', 'UMK KAMPUS BACHOK', 'Kelab Sara TaeKwonDo Martial Art Negeri Kelantan', 'Taekwondo Seni bela diri ataupun seni mempertahankan diri (martial art) merupakan satu kesenian yang timbul sebagai satu cara seseorang itu mempertahankan diri. Ia merupakan kaedah berlawan tradisi dengan atau tanpa senjata dan selalunya tanpa menggunakan senjata api atau senjata moden yang lain. ', 'Kelab Sara TaeKwondo Martial Art Negeri Kelantan yang mula diperkenalkan dalam kokurikulum UMK pada tahun ini (2019) merupakan salah satu daripada 19 Kelab Premier berprestige yang bernaung di bawah TaeKwonDo Malaysia WTF.  Dalam pada masa yang sama juga Kelab Sara TaeKwonDo Martial Art Negeri Kelantan merupakan Ahli Bersekutu  Persatuan TaeKwonDo Negeri Kelantan (TM/WTF). Menjadi syarat utama Kementerian Pendidikan Malaysia memberi kebenaran kepada ahli dan jurulatih bertauliah dan berdaftar dengan Badan Induk Persatuan sahaja untuk mengajar di sekolah-sekolah dan institusi pendidikan tinggi, pada amnya terdapat 177 kelab TaeKwonDo yang berada dibawah Persatuan TaeKwonDo Negeri Kelantan.   ', '', 'Pelajar-pelajar UMK ', '-Tiada-', '500.00', '500.00', 'MOHAN RAJ A/L MANIMARAN', '921118036241', '4630614833', 'PUBLIC BANK', 'sara_martialarts@hotmail.com', 0, '2019-11-05', '2019-11-05', 0, 0, '', '2019-11-05', '2019-10-09 19:24:39', '0000-00-00 00:00:00', '2019-11-05 15:12:41', 'UMK.B01.03.03/700-8/1/1 JLD 2(24)', '0000-00-00', '08', 30),
