(80, 201920201, 'Program Pemerkasaan Kendiri', 'AQFDSW', 333, 0, '2019-10-15', '2019-10-15', 'Dataran Parkir Masjid Tengku Muhammad Fa-Iz Petra', '', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan daripada Pusat Ko Kurikulum, Pejabat Hal Ehwal Pelajar dan Alumni bagi mengadakan Program Pemerkasaan Kendiri (Ko Kurikulum Berkkredit). Program ini dicadangkan untuk dilaksanakan pada 26 November 2019 (Selasa) di Universiti Malaysia Kelantan (UMK), Kampus Jeli.', 'Kemahiran insaniah merupakan salah satu elemen yang penting dalam membentuk seseorang individu yang cemerlang dari pelbagai aspek kehidupaun. Pendedahan awal mengenai kemahiran insaniah perlu dilaksanakan kepada para mahasiswa bagi membantu mereka membina keyakinan dan imej diri yang positif dengan mempunyai nilai penghargaan diri yang tinggi. \r\n\r\nMotivasi merupakan sumber atau alat yang menggalakkan seseorang untuk mencapai matlamat dan terus berusaha untuk mencapai matlamat tersebut sehingga berjaya, Cox (1994). Oleh yang demikian mahasiswa yang mempunyai motivasi yang tinggi akan mempamerkan kesungguhan untuk berjaya. Mereka seboleh mungkin mengelak dari melakukan tingkah laku negatif dalam kehidupan.\r\n\r\nKepimpinan juga merupakan salah satu elemen penting dalam membentuk mahasiswa yang berkualiti kerana kepimpinan merupakan salah satu perkara yang sangat berkait rapat dengan kehidupan manusia seharian.\r\n\r\nSehubungan itu, program-program yang berbentuk pemantapan kendiri bagi meningkatkan nilai kepimpinan kerjasama, kompetensi dan motivasi kepada mahasiswa  wajar dilaksanakan supaya mereka mampu bersaing dengan baik untuk meniti kehidupana pada masa hadapan.\r\n', '', 'Pelajar UMK, Kampus Jeli', '', '620.00', '620.00', 'NUR AIDA BT ELIAS', '860628295490', '03054020545091', 'BIMB', 'nur.aida@umk.edu.my', 0, '2019-11-04', '2019-11-04', 0, 0, '', '2019-11-18', '2019-10-15 14:33:32', '0000-00-00 00:00:00', '2019-11-04 10:46:01', 'UMK.B01.03.03.700-8/1/1 JLD 2(41)', '0000-00-00', '08', 30),
(81, 201920201, 'Pameran Kumpulan Latihan KelanaSiswa Malaysia (Udara) \r\n', 'SF9MSQ', 279, 0, '2019-10-16', '2019-10-16', 'Universiti Malaysia Kelantan', 'Pusat Kokurikulum Universiti Malaysia Kelantan', 'Tujuan kertas kerja ini adalah untuk mendapat kelulusan daripada YBHG. Timbalan Naib Canselor (Hal Ehwal Pelajar&Alumni) bagi mengadakan Pameran Kumpulan Latihan KelanaSiswa Malaysia (Udara) pada karnival kokurikulum yang bakal diadakan pada 26 November 2019 . Tujuan pameran ini adalah untuk memperkenalkan kepada para pelajar mengenai Kumpulan Latihan Kelana Siswa Malaysia (Udara).\r\n', 'Kokurikulum merupakan satu aktiviti yang dilaksanakan oleh Universiti Malaysia Kelantan  untuk meningkatkan interaksi dan integrasi dalam kalangan pelajarnya . Kokurikulum turut dijadikan satu landasan untuk membina sahsiah bersepadu dari segi psikomotor , kognitif dan afektif untuk melahirkan insan dan membentuk insan yang seimbang sejajar dengan apa yang telah termaktub dalam Falsafah Pendidikan Kebangsaan . Kumpulan Latihan Kelanasiswa Malaysia (Udara) Universiti Malaysia Kelantan baru sahaja ditubuhkan pada September 2019 sebagai satu unit uniform yang mensasarkan penyertaan dari para pelajar. Kumpulan Latihan KelanaSiswa Malaysia (Udara) Universiti Malaysia Kelantan ditubuhkan kerana unit ini menunjukkan perkembangan yang memberangsangkan dalam bidang kokurikulum di Malaysia .  Kumpulan Latihan Kelanasiswa Malaysia (Udara) Universiti Malaysia Kelantan mengharapkan satu sokongan yang padu dari Pusat Kokurikulum Universiti Malaysia Kelantan agar unit ini dapat dijadikan satu unit beruniform yang berjaya melahirkan ramai Kelana Siswa yang dapat memberi sumbangan kepada universiti dan negara .', '', 'Ahli Kumpulan Latihan KelanaSiswa Malaysia (Udara) dan Pelajar Universiti Malaysia Kelantan ', 'Tiada', '500.00', '1000.00', 'Nik Mohd Hairi bin Nik Hassan', '830424035585', '164212266635', 'MAYBANK', 'hairielectronic@gmail.com', 0, '2019-11-04', '2019-11-04', 0, 0, '', '2019-11-04', '2019-10-16 08:19:04', '0000-00-00 00:00:00', '2019-11-04 06:38:00', 'UMK.B01.03.03/700-8/1/1 JLD 2(21)', '0000-00-00', '08', 30),
(82, 201920201, 'Persembahan Gamelan Tradisional dan Kontemporari LK2', 'VVDI5V', 268, 0, '2019-10-16', '2019-10-16', ' Dewan Keusahawanan Kampus Kota ', 'Pelajar-pelajar cemerlang muzik Maktab Sultan Ismail dan Encik Shahrul (Pakar dalam Gamelan UMT)', 'Persembahan untuk Karnival Hari Kokurikulum Universiti Malaysia Kelantan Kampus Kota tahun 2019.', 'Siswa dan siswi gamelan LK2 mempelajari asas-asas alat tradisional gamelan sepanjang 14 minggu disertai latihan tarian tradisional dan lagu rakyat. Tambahan pula, selain mempelajari alat gamelan siswa dan siswi juga menggabungkan alatan tradisi yang lain seperti bonang, kenong, gendang, gong dan lain-lain.', '', 'Semua pelajar Gamelan LK2', 'Maktab Sultan Ismail dan Pegawai Muzik UMT (Universiti Malaysia Terengganu)', '515.00', '200.00', '', '0', '', '', '', 0, '2019-10-27', '2019-12-13', 0, 0, '', '0000-00-00', '2019-10-16 19:37:49', '0000-00-00 00:00:00', '2019-12-13 01:09:30', '', '0000-00-00', '-', 20),
(83, 201920201, 'Cadangan Mengadakan Kejohanan Badminton Tertutup UMK Bagi Kursus UKS1041 (Badminton), Kelas LK1 (KO-Kurikulum Berkredit) Di UMK Kampus Kota, Universiti Malaysia Kelantan', '83DZI4', 303, 0, '2019-10-17', '2019-10-17', 'Dewan Badminton Tengku Anis', 'Universiti Malaysia Kelantan Kampus Kota', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan  kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan Mengadakan Kejohanan Badminton Tertutup UMK bagi Kursus UKS 1041 (Ko-Kurikulum Berkredit), di Kampus Kota, Universiti Malaysia Kelantan (UMK). ', 'Kejohanan Badminton Tertutup UMK yang akan diadakan ini untuk memupuk semangat kesukanan dalam kalangan mahasiswa dan mahasiswi supaya melibatkan diri dalam bidang kokurikulum bukan sahaja dalam bidang akademik semata-mata. Kejohanan ini juga bertujuan untuk mendidik mahasiswa dan mahasiswi mengenal erti pentingnya amalan gaya hidup sihat serta boleh merapatkan hubungan silaturrahim antara kaum.', '', 'LK1', 'Tiada', '690.00', '489.00', '', '0', '', '', '', 0, '2019-10-27', '0000-00-00', 0, 0, '', '0000-00-00', '2019-10-17 08:25:07', '0000-00-00 00:00:00', '2019-10-17 15:23:10', '', '0000-00-00', '-', 10),
(84, 201920201, 'Taste of the World', 'GSJCI9', 328, 0, '2019-10-22', '2019-10-22', 'Dewan Serbaguna (DS) dan bahagian hadapan DS, UMK Kampus Jeli', '', 'Kertas kerja ini dikemukakan untuk mendapatkan pertimbangan dan peruntukan daripada Bahagian Hal Ehwal Pelajar dan Alumni (HEPA) Universiti Malaysia Kelantan bagi sebuah acara kebudayaan dan keusahawanan Taste of the World.', 'Program ini adalah berdasarkan keprihatinan pihak mahasiswa dan mahasiswi Kelab Pengurusan Organisasi untuk memperoleh pengalaman baru dalam menguruskan sebuah acara di dalam sebuah organisasi iaitu Taste of the World.  Taste of the World bakal mengumpulkan makanan dari 5 negara untuk dijual sepanjang hari sempena Karnival Ko-Kurikulum di Kampus Jeli. Sebagai pengelola gerai, mahasiswa dan mahasiswi akan didedahkan dengan potensi dan cabaran yang dihadapi oleh usahawan kecil.\r\n', '', 'Para mahasiswa dan mahasiswi, kumpulan akademik, dan staf-staf. ', '', '1025.00', '775.00', 'SITI MUNIRA BINTI ABDUL MADAR', '990715087492', '08086022200008', 'BIMB', 'muniramdar7492@gmail.com', 0, '2019-10-28', '2019-10-28', 0, 0, '', '0000-00-00', '2019-10-22 12:47:15', '0000-00-00 00:00:00', '2019-12-01 09:52:34', '', '0000-00-00', '-', 20),
(85, 201920201, 'Karnival Mini \"Ini Malaysia Kita\"', '489LLD', 316, 0, '2019-10-23', '2019-10-23', 'UMK Kampus Bachok', '', 'Kertas kerja “Karnival Mini Ini Malaysia Kita” ini disediakan adalah bagi memohon kelulusan dan kerjasama dari pihak Fakulti Teknologi Kreatif & Warisan serta pihak Universiti Malaysia Kelantan dalam menjayakan sebuah program bercirikan patriotik.\r\n\r\nProgram ini merupakan program yang melibatkan anak-anak muda yang aktif dalam dunia seni dan majoritinya adalah mahasiswa UMK. Selain daripada mengetengahkan bakat, program ini juga bertujuan untuk membentuk jati diri serta menyampaikan mesej-mesej positif melalui karya-karya yang dipersembahkan kepada khalayak ramai.\r\n\r\nSelain itu, program ini dilaksanakan bagi memberi pendedahan kepada pelajar tentang menguruskan dan menguji kemahiran berkomunikasi antara pelajar dengan masyarakat. Program ini juga dapat menimbulkan rasa kesedaran dan meningkatkan tahap keyakinan diri pelajar.\r\n', 'Program yang bertemakan patriotik ini bakal mengumpulkan bakat-bakat seni yang majoritinya adalah pelajar Universiti Malaysia Kelantan. Persembahan yang berformatkan akustik ini lebih bersifat santai, mempunyai nilai-nilai yang selaras dengan adat ketimuran masyarakat Malaysia serta bermaklumat. Sepanjang program ini banyak persembahan yang akan disampaikan seperti tayangan dokumentari/filem, pameran kesenian, wawancara/dialog spontan, monolog, deklamasi puisi, nyanyian berkumpulan dan nyanyian solo.\r\n\r\nDiharapkan program ini akan dapat memberikan manfaat yang berguna kepada semua pihak terutamanya mahasiswa di UMK. Program ini akan dihidangkan dengan pelbagai input berkaitan nilai patriotik yang seharusnya dirasai setiap masyarakat pada sepanjang masa, bukan hanya tertumpu pada bulan-bulan tertentu sahaja. Dengan itu, segala kerjasama dan sokongan dari semua pihak sama ada yang terlibat secara langsung atau tidak langsung amatlah diharapkan. Sesungguhnya hasrat murni dalam merealisasikan matlamat program ini hanya ALLAH S.W.T sahaja yang mampu membalasnya.\r\n', '', 'Warga Kampus UMK Bachok', '', '1200.00', '1150.00', 'MOHD SAFFIRI BIN IBRAHIM', '821016035215', '153029226745', 'MAYBANK', 'saffiri@umk.edu.my', 0, '2019-10-30', '2019-10-30', 0, 0, '', '0000-00-00', '2019-10-23 10:09:27', '0000-00-00 00:00:00', '2019-10-30 14:30:14', '', '0000-00-00', '-', 20),
