(88, 201920201, 'PROGRAM HARI KOKURIKULUM UMK\r\nKOR SUKARELAWAN POLIS SISWA / SISWI\r\nUNIVERSITI MALAYSIA KELANTAN\r\nDI KAMPUS KOTA \r\nUNIVERSITI MALAYSIA KELANTAN', 'F58ZKD', 0, 2, '2019-10-25', '2019-10-25', 'Universiti Malaysia Kelantan ', 'PDRM', 'Tujuan kertas kerja cadangan ini dimajukan adalah untuk memohon kelulusan khas daripada Unit Kokurikulum bagi mengadakan Program Hari Kokurikulum UMK 2019 bagi aktiviti persembahan pembukaan, senamrobik, sukaneka dan makan malam yang akan diadakan di Universiti Malaysia Kelantan dan Pantai Senok Bachok Kelantan kepada pelatih-pelatih Kor Sukarelawan Polis Siswa / Siswi (Kor SUKSIS) Universiti Malaysia Kelantan beserta perbelanjaan mengurus program. ', 'Para Pelatih Senior, Inter dan Junior Kor SUKSIS UMK 2019 akan mengikuti Program Hari Kokurikulum UMK 2019 yang akan diadakan di Kampus Kota Universiti Malaysia Kelantan dan Pantai Senok Bachok Kelantan.', '', 'KOR SUKSIS UMK', 'TIADA', '0.00', '500.00', 'MUHAMAD RIZAL B. CHE RANI', '761226085243', '164409571304', 'MAYBANK', 'rizalcrfx@gmail.com', 0, '2019-11-06', '0000-00-00', 0, 0, '', '2019-11-18', '2019-10-26 05:31:18', '0000-00-00 00:00:00', '2019-11-18 16:28:40', 'UMK.B01.03.03.700-8/1/1 JLD 2(43)', '0000-00-00', '08', 30);
