(89, 201920201, 'MENGADAKAN PERTANDINGAN, PERSEMBAHAN, PAMERAN DAN GERAI JUALAN SERTA MAJLIS PENYAMPAIAN SANDANG KEBESARAN GAYONG KEPADA PEGAWAI KADET BADAN BERUNIFORM SISWAZAH BRIGED GAYONG UMK', 'SR2D2S', 307, 0, '2019-10-29', '2019-10-29', 'KAMPUS KOTA DAN BACHOK', 'PUSAT KOKURIKULUM UMK & INSTITUT SILAT SENI GAYONG ( Pusat Pengajian Tinggi Silat Seni Gayong Berakademik )', 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukan daripada Pusat Ko-Kurikulum, Pejabat Hal Ehwal Pelajar bagi Cadangan Mengadakan Persembahan, Pameran, Gerai Jualan Badan Beruniform Siswazah Briged Gayong Umk bagi Kursus UKU10502 (Ko-Kurikulum Berkredit).', 'Program ini merupakan salah satu program utama dalam memperkenalkan dan mempromosikan Modul Subjek Pengajian Briged Gayong.\r\n\r\nProgram ini amat penting kepada pegawai kadet kerana ianya boleh melatih pegawai kadet briged gayong menguruskan sesebuah program dan aktiviti organisasi ini.\r\n\r\nIanya akan melahirkan pegawai kadet yang berdisiplin tinggi dan mendidik agar pegawai mempunyai nilai jati diri yang tinggi dan cemerlang.\r\n\r\nManakala Majlis Penganugerahan Sandang Kebesaran Gayong kepada tetamu VIP, Kehormat dan Pegawai Kadet Badan Beruniform Siswazah Briged Gayong UMK adalah satu Istiadat Rasmi di dalam pasukan ini. Ianya memberi satu penghargaan dan peningkatan prestasi dalam mengurus organisasi ini.', '', 'Siswazah Universiti Malaysia Kelantan dan masyarakat luar.', 'Swasta iaitu usahawan dari kalangan pegawai briged gayong ( fasi )', '1250.00', '1420.00', 'MUHAMAD AMRU BIN RUSLI', '830423035591', '03045022532441', 'BIMB', 'pang5amru@gmail.com', 0, '2019-11-04', '2019-11-04', 0, 0, '', '2019-11-04', '2019-10-29 17:12:14', '0000-00-00 00:00:00', '2019-11-04 14:18:25', 'UMK.B01.03.03/700-8/1/1 JLD 2(22)', '0000-00-00', '08', 30),
