(92, 201920201, 'Karnival Tae Kwon Do 2019', '3S3V38', 330, 0, '2019-11-04', '2019-11-04', 'Dewn Serbaguna', 'Persatuan Tae Kwon Do Kelantan', 'Menyediakan ruang dan platform supaya seni mempertahankan diri dapat didedahkan kepada para pelajar, pensyarah-pensyarah serta staf-staf sokongan.\r\n', 'Taekwondo juga disebut sebagai Tae Kwon Do atau Taekwon-Do. Ia merupakan sukan nagara Korea. Dalam perkataan Korea ‘Tae’ bermaksud kaki, Kwon meaning tangan dan ‘Do’ bermaksud teknik, oleh itu, Taekwondo bermaksud ‘teknik menguna kaki dan tangan. Pada dinasti Silla (668AD-935AD). Seorang cina yang bernama Chuan Fa melatih tentera Korea pelbagai seni pertahanan seperti menyerang dengan tangan kosong. Pada awal dinasti Joseon(1393-1910), Subak dibahagikan kepada Taekyon dan Yusul. Pada abad18, King Chongjo diminta menghasilkan Muye Dobo Tongji, ini adalah suatu seni pertahanan yang teratur, ia termasuk berdisiplin dan kosong tangan Kwonbup. Dalam tempoh Jepun menakluki Korea (1910-1945), banyak orang Korea menentang orang Jepun dengan seni pertahanan ini China seperti karate. Pada tahun 1945, banyak sekolah seni pertahanan ditubuhkan. Pada tahun 1955, seni pertahanan ini disebutkan dalam pelbagai nama. Presiden South Korea Syngman Rhee cuba menyatukan semua seni pertahanan sebagai ‘Taekwondo’.Pada tahun 1959, ‘Korean Taekwondo’ Association’(KTA) ditubuhkan. General Choi ialah presiden. Pada tahun 1960, Jhoon Rhee mengajar Korean Karate di United States. Beliau menukar nama ini kepada Taekwondo selepas berjumpa dengan presiden Choi Hong Hi. Oleh itu, Rhee boleh dikatakan sebagai bapa Taekwondo Amerika.\r\nPada tahun 1972, Kukkiwon dijadikan pusat Taekwondo di Korea selatan. Pada tahun 1973, World Taekwondo Federation(WTF) ditubuhkan oleh kerajaan Korea selatan untuk bersaing dengan ITF. Pada Julai 1980, ‘International Olympic Committee’ memperkenalkan WTF(World Taekwondo Federation). Taekwondo adalah sukan demotasi pada tahun 1988 Seoul Olimpik. Ia diikhtirafkan sebagai salah satu sukan Olimpik sejak tahun 2000 sydney Olimpik.\r\n', '', 'Pelajar UMK Jeli', '', '521.00', '376.00', 'Mohamad Aly Bin Mohd Safi', '851205625019', '153010324094', 'MAYBANK', 'Alysafi5019.11@gmail.com', 457, '2019-11-21', '2019-11-21', 0, 0, '', '2019-11-24', '2019-11-04 09:11:39', '0000-00-00 00:00:00', '2019-11-21 11:12:57', 'UMK.B01.03.03.700-8/1/1 JLD 2(54)', '0000-00-00', '-', 30),
(93, 201920201, 'Karnival Tarian Tradisional Kebangsaan Sempena Karnival Kukurikulum UMK 2019', 'D3ODHG', 329, 0, '2019-11-05', '2019-11-05', 'Dewan Utama UMK Kampus Jeli', 'Pusat Kokurikulum UMK', 'Tujuan kertas kerja ini dikemukakan adalah untuk mendapatkan pertimbangan dan kelulusan daripada Pusat Kokurikulum , Pejabat Hal Ehwal Pelajar dan Alumni berhubung cadangan menganjur Karnival Tarian Tradisional Kebangsaan sempena Karnival Kokurikulum UMK 2019.', 'Tarian Tradisional Kebangsaan merupakan rampaian tarian yang terdiri daripada tarian Asli, Inang, Zapin, dan Joget yang diamalkan diseluruh Malaysia. Kursus UKP1031 Tarian Tradisional diperkenalkan di Universiti Malaysia Kelantan bertujuan untuk memberi pendedahan kepada mahasiswa/i dalam mengenali dan mempelajari seni persembahan  ini agar terus kekal diamalkan. Karnival Tarian Tradisional Kebangsaan ini dikelola dan dipersembah oleh pelajar dari LJ1 yang dibimbing oleh Encik Mohamad Khairullah bin Atan.', '', 'Pelajar UKP1031', '', '500.00', '500.00', 'MOHAMAD KHAIRULLAH BIN ATAN', '920127015253', '7042967225', 'CIMB', 'mohamadkhairullahatan27@gmail.com', 0, '2019-11-10', '2019-11-10', 0, 0, '', '2019-11-18', '2019-11-05 09:53:59', '0000-00-00 00:00:00', '2019-11-10 14:24:32', 'UMK.B01.03.03.700-8/1/1 JLD 2(42)', '0000-00-00', '08', 10),
