INSERT INTO `pro_objective` (`id`, `pro_id`, `obj_text`, `obj_order`) VALUES
(1, 48, 'Tujuan kertas kerja ini dikemukakan adalah untuk memohon pertimbangan dan kelulusan peruntukkan daripada Pusat Ko-kurikulum, Pejabat Hal Ehwal Pelajar.', 0),
(2, 58, 'Memberi peluang kepada pelajar untuk memantapkan lagi tahap pengetahuan dan kemahiran dalam menguruskan sesuatu pertandingan.', 0),
(3, 58, 'Dengan adanya Pertandingan ini, diharapkan secara langsung dapat menambahkan minat pelajar untuk terlibat secara konsisten dalam sukan Petanque', 1),
(4, 58, 'Di samping itu, program ini juga membantu pelajar untuk mengisi masa lapang dengan aktiviti yang berfaedah dan menyihatkan tubuh badan.', 2),
(5, 58, 'Program ini diharapkan dapat mencungkil bakat pelajar yang terlibat supaya sukan Petanque sentiasa mempunyai pelapis yang terbaik.', 3),
(6, 59, '1.      Untuk meningkatkan kemahiran pelajar yang mengambil kursus UKS1081 dan  dapat mendedahkan cara perlawanan sebenar Tenis. \r\n \r\n', 0),
(7, 59, '2.     Memupuk semangat kesukanan dalam kalangan ahli.', 1),
(8, 61, 'Melahirkan bakal pelajar UMK yang unggul dengan melengkapkan mereka dengan aktiviti yang mencabar mental dan fizikal.\r\n\r\nMemupuk semangat berpasukan dalam kalangan pelajar UMK melalui aktiviti rekreasi yang menyihatkan.\r\nMengetengahkan dan memperkenalkan sukan bola baling dengan lebih dekat kepada para pelajar UMK.\r\n\r\nPenerapan nilai-nilai kemahiran insaniah iaitu komunikasi, kritis dan menyelesaikan masalah, kerja berpasukan, keusahawanan, pembelajaran berterusan dan pengurusan maklumat, etika dan moral profesional serta kemahiran kepimpinan dalam kalangan pelajar melalui kejohanan yang diadakan.\r\n', 0),
(9, 32, 'Membimbing dan melatih para pelajar berinteraksi sesama sendiri dan berkongsi pengalaman semasa menyediakan pameran dan mengendalikan program.\r\n', 0),
