(162, 14, 'Memberi peluang kepada pelajar untuk memantapkan lagi tahap pengetahuan dan kemahiran dalam menguruskan sesuatu pertandingan. Dengan adanya Pertandingan ini, diharapkan secara langsung dapat menambahkan minat pelajar untuk terlibat secara konsisten dalam sukan Petanque. Di samping itu, program ini juga membantu pelajar untuk mengisi masa lapang dengan aktiviti yang berfaedah dan menyihatkan tubuh badan. Oleh itu, program ini diharapkan dapat mencungkil bakat pelajar yang terlibat supaya sukan Petanque sentiasa mempunyai pelapis yang terbaik. kesannya, pelajar dapat mempelajari Teknik asas dalam sukan Petanque.', 0),
