(187, 93, '1. Tujuan utama karnival ini diadakan adalah untuk menggalakkan pelajar bergerak aktif sebagai usaha menyemarakkan seni budaya. \r\n2. Karnival ini juga ingin memberi pendedahan kepada pelajar untuk mengurus acara kesenian dan kebudayaan.\r\n3. Mendedahkan pelajar kepada satu kaedah pembelajaran serta meningkatkan tahap keyakinan diri dalam mempersembahkan tarian yang dipelajari.', 0),
