(191, 88, 'Memupuk sikap kejersama berpasukan dalam diri pelatih dan seterusnya melahirkan pelatih-pelatih yang   berkualiti tinggi. \r\n\r\n- Nilai- nilai kerjasama berpasukan ini dapat diterapkan dalam diri setiap pelatih dengan melakukan setiap aktiviti yang disediakan bersama pelatih-pelatih dan jurulatih Kor Suksis.', 0),
