(193, 88, 'Mengeratkan hubungan antara pelatih dengan pelatih dan pelatih dengan jurulatih. \r\n-	Hubungan antara pelatih dan jurulatih dapat dieratkan kerana semua aktiviti dan program yang dijalankan melibatkan semua pelatih dan jurulatih Kor Suksis. Program anjuran pihak KOR SUKSIS akan melibatkan semua pelatih Kor Suksis Senior, Inter dan Junior.\r\n', 2),
