INSERT INTO `sp_course_profile` (`id`, `crs_version_id`, `prerequisite`, `offer_sem`, `offer_year`, `offer_remark`, `synopsis`, `synopsis_bi`, `transfer_skill`, `transfer_skill_bi`, `feedback`, `feedback_bi`, `objective`, `objective_bi`, `rational`, `rational_bi`, `created_at`, `updated_at`, `staff_academic`, `requirement`, `additional`, `requirement_bi`, `additional_bi`, `offer_at`) VALUES
(1, 484, 0, 0, 0, '', 'Kursus Kokurikulum ini bertujuan mendedahkan pelajar-pelajar kepada ilmu sukan petanque dari segi kemahiran,teori dan teknikal. Dari segi teori, kursus ini lebih menjurus kepada sejarah, latar belakang, terminologi, pengurusan diri dan lain-lain yang berkaitan dengan petanque. Manakala dari segi teknikal, kursus ini lebih menumpukan kepada latihan amali (practical) dari segi kemahiran bermain petanque.\r\n\r\n\r\n', 'This Co-curriculum course aims to expose students to the science of petanque in terms of skills, theories and the technical. Theoretically, this course is more geared towards history, background, terminology, self-management and others related to petanque. Upon technical, this course focuses on practical training in terms of petanque playing skills.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik\r\n\r\nTertakluk kepada Peraturan Akademik UMK.\r\n\r\n', 'Online System, Advisory Academic System.\r\n\r\nSubject to UMK’s Academic Rules and Regulations.\r\n', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n\r\n\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.', 'Exposure to students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms between other universities either domestically or abroad through co-curricular activities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(2, 465, 0, 0, 0, '', 'Kursus ini meliputi sejarah permainan bola jaring, pengenalan peralatan, gelanggang dan undang-undang permainan, mengetahui latihan dan teknik permainan, pengukuhan kemahiran dalam permainan, pengurusan padang / gelanggang dan pasukan serta pengelolaan pertandingan / projek .\r\n\r\n\r\n', 'This course covers the history of the game of netball, the introduction of equipment, courts and laws of the game, learn the exercises and techniques of the game, the strengthening of skills in the game, the management of court / field and team and organizing competitions / projects.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik\r\n\r\n', 'Online System, Advisory Academic System.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.\r\n\r\n\r\n', 'Exposure to students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms among other universities either domestically or abroad through co-curricular activities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(3, 467, 0, 0, 0, '', 'Kursus ini meliputi sejarah permainan bola sepak, pengenalan peralatan, gelanggang dan undang-undang permainan, mengetahui latihan dan teknik permainan, pengukuhan kemahiran dalam permainan, pengurusan padang / gelanggang dan pasukan serta pengelolaan pertandingan / projek.\r\n\r\n', 'This course covers the history of football, the introduction of equipment, courts and laws of the game learn the exercises and techniques of the game, the strengthening of skills in the game, the management of court / field and team and organizing competitions / projects.\r\n', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik\r\n\r\n', 'Online System, Advisory Academic System.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n\r\n\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.\r\n\r\n\r\n\r\n\r\n\r\n', 'Exposure to students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms between other universities either domestically or abroad through co-curricular activities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(4, 468, 0, 0, 0, '', 'Kursus ini memperkenalkan kepada para pelajar mengenai permainan bola tampar sama ada dari aspek teori dan praktiknya, di samping itu aspek sejarah dan perkembangan sukan ini turut disentuh. Etika dan peraturan dan undang-undang permainan juga diterapkan kepada para pelajar. Selain itu, tayangan video juga sebagai satu kaedah untuk para pelajar dapat menganalisis sesuatu perlawanan dalam permainan bola tampar.\r\n\r\n', 'This course introduces the students about Volleyball either in terms of theory and practice, in addition to the history and development of this sport were also touched. Ethics and the rules and laws of the game are also applied to students. In addition, the video also as a means for students to be able to analyze a match in volleyball.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik\r\n\r\n', 'Online System, Advisory Academic System.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.\r\n\r\n', 'Exposure to students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms among other universities either domestically or abroad through co-curricular activities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(5, 478, 0, 0, 0, '', 'Kursus ini memberikan pendedahan kepada pelajar tentang prinsip-prinsip menguruskan kelab dan persatuan. Ini bagi membolehkan mereka mendapat pengetahuan dan kemahiran khususnya dalam berinteraksi, membina komunikasi yang baik dan berkeyakinan terhadap diri sendiri.', 'This course gives the exposure to the students on the club and association management principles. This enables them to acquire knowledge and skills especially in interaction, develop effective communication and high self-confidence.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar \r\n\r\n', 'Online System, Advisory Academic System and Student Evaluation.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-disciplinary activities.', 'Kursus ini memberi pengetahuan dan kemahiran khususnya dalam berinteraksi, berkomunikasi dengan baik dan berkeyakinan terhadap diri sendiri dan juga masyarakat sekeliling sewaktu berpersatuan.', 'This course provides the exposure and skills especially in interaction; develop effective communication and high self-confidence.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(6, 480, 0, 0, 0, '', 'Kursus ini memberikan penekanan tentang bagaimana pelajar-pelajar diberi pendedahan kepada prinsip kepimpinan dan motivasi. Ini bagi membolehkan mereka mendapat pengetahuan dan kemahiran khususnya dalam memimpin dan berkeyakinan terhadap diri sendiri. ', 'This course emphasises on how students will be exposed to leadership and motivation principles. This is to enable them to gain the knowledge and skills particularly in leading and being confident towards themselves.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar \r\n\r\n', 'Online System, Advisory Academic System and Student Evaluation.\r\n', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Kursus ini diwujudkan bagi membina jati diri pelajar dalam aspek kepimpinan dan motivasi.  Modul ini menyediakan ruang kepada pelajar untuk mengingkatkan kemahiran kepimpinan dan motivasi diri secara kolektif.', 'This course is designed to develop students’ identity in leadership and motivational aspects. This module provides opportunities for students to collectively enhance their leadership skills and self-motivation.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(7, 490, 0, 0, 0, '', 'Kursus ini meliputi sejarah permainan futsal, pengenalan peralatan, gelanggang dan undang-undang permainan, mengetahui latihan dan teknik permainan, pengukuhan kemahiran dalam permainan, pengurusan padang / gelanggang dan pasukan serta pengelolaan pertandingan / projek', 'This course covers the history of futsal, the introduction of equipment, courts and laws of the game learn the exercises and techniques of the game, the strengthening of skills in the game, the management of court / field and team and organizing competitions / projects.\r\n', '', '', 'Penilaian berterusan:                100%\r\n\r\na.   Refleksi 	                            50%                \r\n     \r\nb.   Pengurusan Aktiviti              50 %\r\n \r\n      JUMLAH                           	  100%\r\n\r\nPeperiksaan Akhir:                   TIADA\r\nPentaksiran Akhir :                   TIADA\r\n\r\nTertakluk kepada Peraturan Akademik UMK.', 'Continuous assessment:              100%\r\n\r\na.   Reflexy	 	                       50%                \r\n     \r\nb.   Activity management                50 %\r\n \r\n      TOTAL                            	      100%\r\n\r\nFinal Examination:                       TIADA\r\nFinal Assessment:                       TIADA\r\n\r\nSubject to UMK’s Academic Rules and Regulations.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.\r\n', 'Kursus ini bertujuan untuk menyediakan pelajar dengan landasan akademik dalam futsal dan membolehkan mereka memahami konsep asas permainan futsal. Penekanan diberikan kepada pembangunan kemahiran teknikal yang kuat digabungkan dengan keupayaan pengurusan\r\n', 'The course aims to provide students with an academic track in futsal and allowing them to understand the basic concepts of futsal games. Emphasis is given on the development of strong technical skills combined with management capabilities ', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(8, 486, 0, 0, 0, '', 'Kursus Kokurikulum ini bertujuan mendedahkan pelajar-pelajar kepada ilmu sukan ping pong dari segi kemahiran,teori dan teknikal.Dari segi teori,kursus ini lebih menjurus kepada sejarah,latar belakang,terminologi,pengurusan diri dan lain-lain yang berkaitan dengan ping pong.Manakala dari segi teknikal,kursus ini lebih menumpukan kepada latihan amali (practical) dari segi kemahiran bermain ping pong.', 'This Co-curriculum course aims to expose students to the science of table tennis in terms of skills, theories and the technical. Theoretically, this course is more geared towards history, background, terminology, self-management and others related to table tennis. Upon technical, this course focuses on practical training in terms of table tennis playing skills.\r\n', '', '', 'Penilaian berterusan:               100%\r\n\r\na.   Refleksi	                           50%                \r\n     \r\nb.   Pengurusan Aktiviti              50 %\r\n \r\n      JUMLAH                           	  100%\r\n\r\nPeperiksaan Akhir:                   TIADA\r\nPentaksiran Akhir :                   TIADA\r\n\r\nTertakluk kepada Peraturan Akademik UMK.', 'Continuous assessment:               100%\r\n\r\na.   Refleksi/ reflexy	 	                50%                \r\n     \r\nb.   Activity management                50 %\r\n \r\n      TOTAL                            	      100%\r\n\r\nFinal Examination:                        TIADA\r\nFinal Assessment:                        TIADA\r\n\r\nSubject to UMK’s Academic Rules and Regulations.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.\r\n', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.\r\n\r\n', 'Exposure to students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms between other universities either domestically or abroad through co-curricular activities.\r\n', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(9, 479, 0, 0, 0, '', 'Kunsus ini memberikan pendedahan pelajar kepada prinsip, teori dan teknik-teknik dalam berkomunikasi. Perkara ini membolehkan pelajar mendapatkan pengetahuan dan kemahiran khususnya dalam berinteraksi di hadapan khalayak dengan penuh keyakinan.', 'This course provides student exposure to principles, ttrcofies and techniques in communicating. This allows sfudenfs to gain the knowledge and skillq espeoally in interacting with fie audience with confidence.', '', '', 'sistem atas talian', 'online', 'Ivleningkafltan kemahiran insaniah dalam kalangan pelajar terutamanya kemahiran komunikasi. Kemahiran yang diperoleh diharap dapat nembantr petaiar untuk mempertaik khap keyakiren di{i dalam bertradapan derqan khalayak yarg pelb4ai.', ']nuease saft skills arnong students, especially cammunication skiJls. The skills aquired are expected to help sfudenfs to improve their level of\r\nconfidence in dealing with diverse audiences.', 'Penerapan kemahiran insaniah terutamanya berkaitan dengan kemahiran komunikasi amat penting dalam membantu pelajar membina keyakinan diri. Kemahiran yang diperoleh dapat membantu pelajar untuk melibafl<an diri secara aktif dalam perbincangan apabila berada dalam dunia pekerjaan.', 'The application of sofi skills especially related with cammunication skrlh is essenfi\'alin helping sfudenfs build self+nnfidence. The skills aquird help sfudenfs to actively engage in discussrbns when in the wadd of wo*.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(10, 491, 0, 0, 0, '', 'Kursus Kokurikulum ini bertujuan mendedahkan pelajar-pelajar kepada ilmu sukan memanah dari segi kemahiran, teori dan teknikal. Dari segi teori, kursus ini lebih menjurus kepada sejarah, latarbelakang, terminologi, pengurusan diri dan lain-lain yang berkaitan dengan memanah. Manakala dari segi teknikal, kursus ini lebih menumpukan kepada latihan amali (practical) dari segi kemahiran bermain memanah.\r\n\r\n', 'This Co-curriculum course aims to expose students to the science of archery in terms of skills, theories and the technical. Theoretically, this course is more geared towards history, background, terminology, self-management and others related to archery. Upon technical, this course focuses on practical training in terms of archery playing skills.\r\n', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik\r\n\r\n', 'Online System, Advisory Academic System.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n\r\n\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.\r\n\r\n\r\n', 'Exposure to students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms between other universities either domestically or abroad through co-curricular activities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
