(30, 505, 44, 0, 0, '', 'Kursus ini bertujuan untuk melatih pegawai kadet pada peringkat asas sebagai pengenalan kepada alam ketenteraan dan juga operasi TLDM. Kursus ini juga merangkumi pengenalan dan asas dalam bidang ketenteraan, tradisi TLDM, penrtadbiran dan pengurusan, komunikasi, navigasi umum, ilmu pelaut, persenjataan dan renang. Matlamat kursus ini dicapai melalui latihan amali dikampus dan juga pengkalan TLDM merangkumi ujian teori, praktikal dan simulasi. ', 'This course aims to train cadet officers at the basic level as an introduction to the military and the RMN operations. The course also covers the introduction and foundation in the field of military, naval traditions, administration and management, communication, general navigation, sail science, armaments and swimming. The goal of this course is achieved through internationally rehearsals and RMN base covers theoretical, practical and simulation tests.', '', '', 'Penilaian berterusan: \r\n\r\na.   Refleksi            		- 	50%                \r\n      \r\n\r\nb.   Pengurusan Aktiviti    - 	50%                \r\n\r\n\r\n            \r\n      JUMLAH   		                            100%\r\n		\r\nPeperiksaan akhir : Tiada / (0%)\r\n\r\n\r\n\r\nTertakluk kepada Peraturan Akademik UMK.\r\n', 'Continuous assessment: \r\n\r\na.  Reflection    		- 	50%                \r\n  \r\n\r\nb.    Activity Management    - 	50%                \r\n\r\n\r\n            \r\n      TOTAL		                            100%\r\n		\r\nFinal examination: None (0%)\r\n\r\n\r\n\r\n\r\nSubject to UMK’s Academic Rules and Regulations.', 'Matlamat kursus ini adalah untuk melahirkan pelajar yang memiliki pengetahuan dan berkeupayaan dalam TLDM serta kemahiran  insaniah bagi menyesuaikan diri dalam persekitaran kerjaya.', 'The aim of the course is to produce students with knowledge and skills in RMN as well as soft skills to adapt to the career environment.', 'Kursus ini bertujuan untuk menyediakan pelajar dengan landasan akademik dalam TLDM dan membolehkan mereka memahami konsep asas TLDM. Penekanan diberikan kepada pembangunan kemahiran teknikal yang kuat digabungkan dengan keupayaan pengurusan', 'This course aims to provide students with an academic foundation in RMN and enable them to understand the basic concepts of RMN. Emphasis is given on the development of strong technical skills combined with management capabilities', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(11, 482, 0, 0, 0, '', 'Kursus ini memberi pendedahan kepada pelajar tentang pengenalan fotografi, jenis-jenis kamera digital, lensa, lampu denyar, pencahayaan, penuras, tripod dan pasca pemprosesan asas foto digital. Diakhir kursus ini, pelajar dapat mengaplikasikan hasil pembelajaran dalam pengajian mereka. ', 'This course introduces students to the introduction of photography, digital camera types, lenses, flashlights, lighting, filters, tripod and basic digital photo processing. At the end of the course, students can apply the learning outcomes in their studies.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar ', 'Online System, Advisory Academic System and Student Evaluation.', 'Pelajar dapat menunjukkan penguasaan teknik fotografi dan pengendalian kamera serta dapat menunjukkan kerjasama berpasukan melalui projek fotografi.', 'Students can demonstrate the mastery of photographic techniques and camera operations and can demonstrate teamwork through photography projects', 'Kursus ini lebih menekankan kepada kemahiran, latihan dan pengetahuan mengenai bidang seni fotografi, audio dan video secara seimbang dan menyeluruh dengan potensi diri dalam aspek jasmani, emosi rohani dan intelek di dalam diri setiap pelajar. ', 'This course emphasizes on the skills, training and knowledge of photography, audio and video fields in a balanced and holistic manner with the potential of being physically, emotionally and intellectually within each student.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(12, 481, 0, 0, 0, '', 'Kursus ini memberi pendedahan kepada pelajar proses dan cara merekabentuk weblog bermula daripada mempelajari asas-asas multimedia seperti grafik, video, animasi, audio, teks dan interativiti. Pelajar juga didedahkan tentang jenis dan tujuan weblog termasuk kaedah pendaftaran, menentukan susun letak elemen, memasukkan pautan, teks, bunyi, animasi, gambar dan video.', 'This course provides exposure to learners about the process and how weblog designing begins from learning multimedia basics such as graphics, video, animation, audio, text and interaction. Students are also exposed to weblog types and purposes including registration methods, determining the layout of elements, inserting links, texts, sounds, animations, pictures and videos.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik', 'Online System, Advisory Academic System', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian', 'This course is offered to give students the opportunity to enhance their soft skills through cross-disciplinary activities', 'Kursus ini mendedahkan  pelajar mengenai aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat. Ia juga menitikberatkan   amalan disiplin kepada para pelajar dan menggalakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum', 'This course exposes students on aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning. It also emphasizes discipline among students and promotes collaborative platforms among other universities either domestically or internationally through co-curricular activities', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(13, 476, 0, 0, 0, '', 'Kursus ini memberikan pendedahan awal kepada pelajar tentang teknik- teknik vokal seperti postur, pengeluaran suara, pengawalan pernafasan, register (perletakan suara) artikulasi, sebutan dan ekspresi. Pelajar juga mempelajari cara mengamalkan teknik- teknik vokal yang asas melalui nyanyian solo dan koir. Tiap-tiap pelajar akan bepeluang melaksanakan tanggungjawab masing-masing semasa penggendalian projek dalam kumpulan.', 'This course provides early exposure to students about vocal techniques such as posture, voice production, breathing control, articulation register, speech and expression. Students also learn how to practice basic vocal techniques through solo singing and choir. Each student will be able to perform their respective responsibilities during the project operation in the group', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar', 'Online System, Advisory Academic System and Student Evaluation', '1.	Meningkatkan keyakinan para pelajar melalui aktiviti yang dijalankan\r\n\r\n2.	Mewujudkan satu persefahaman dikalangan para pelajar yang berlainan agama dan bangsa\r\n\r\n3.	Memastikan persembahan koir yang dijalankan ini mencapai standart yang telah ditetapkan.\r\n', '1. Increase the confidence of students through the activities carried out\r\n\r\n2. Create an understanding among students of different religions and nations\r\n\r\n3. Ensure that the performed choir performs the standard set.', 'Kursus ini diadakan bagi memperkenalkan bentuk dan juga  teknik-teknik nyanyian yang betul dalam persembahan koir . Setiap palajar yang terlibat akan dilatih dan ini menjamin persembahan koir lebih baik dan menarik', 'The course was held to introduce the form and also the proper singing techniques in choir performances. Each participating student will be trained and this ensures choir performances are better and more attractive', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(14, 466, 0, 0, 0, '', 'Kursus ini memberikan pendedahan kepada pelajar tentang jenis-jenis tarian Melayu yang terdapat di Malaysia.  Pelajar akan diperkenalkan dengan asas rentak tari iaitu tarian zapin, joget dan inang.  Pelajar juga akan diperkenalkan dengan asas pengurusan kumpulan tarian pada tahap ini.  Pelajar dikehendaki mempelajari tiga jenis langkah tari iaitu zapin, joget  dan inang.  Pelajar juga berpeluang mempelajari jenis-jenis busana tradisional yang berkaitan dengan tarian serta kaedah asas solekan bagi satu-satu persembahan.', 'This course exposes the student on the types of Malay dances in Malaysia. Students will be introduced to the basic of dance rhythms, i.e. zapin, joget and inang dance. Students will also be introduced with the basic management of dance group at this level. Students are required to learn three dance steps, that is, zapin, joget and inang. Student will also have the opportunities to learn the various types of traditional costumes related to the dance and the basic make-ups of each performance.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar ', 'Online System, Advisory Academic System and Student Evaluation.', 'Kursus ini dijalankan adalah untuk merakyatkan dan menyemarakkan seni tarian tradisional di kalangan pelajar IPT. Melaluinya, seluruh pelajar yang mengikuti kursus ini dapat mempelejari teknik-teknik bidang tarian tradisional tersebut.', 'This course is aimed at promoting and promoting traditional dance art among IPT students. Throughout it, all students taking the course can explore the techniques of the traditional dance field', 'Salah satu nilai teras untuk melestarikan kesenian dan kebudayaan tradisional agar dihargai oleh mahasiswa universiti. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mendidik mahasiswa supaya lebih bertanggungjawab, dapat bekerjasama serta mewujudkan persefahaman dalam kerja berkumpulan.', 'One of the core values to preserve traditional arts and culture is to be appreciated by university students. It is also a great way to enhance the self-esteem and self-esteem of university students. Educating students to be more responsible, able to work together and create understanding in group work.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(15, 469, 0, 0, 0, '', 'Kursus ini meliputi: sejarah permainan badminton peringkat antarabangsa dan Malaysia, pengenalan alatan, gelanggang dan undang-undang permainan, mengetahui latihan dan taktik permainan, pengukuhan kemahiran dalam permainan, pengurusan padang/gelanggang dan kemahiran berpasukan dalam pengelolaan pertandingan.', 'The course covers: the history of Malaysia and international badminton games, the introduction of tools, court and game law, to know training and game tactics, strengthening of in-game skills, field management and team skills in competition management', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik\r\n', 'Method for Feedback on Performance: e.g. Online System, Advisory Academic System.\r\n', 'Mengikut silibus masing-masing', 'According to the syllabus respectively', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian masing-masing.', 'This course is offered to give students the opportunity to enhance their soft skills through cross-disciplinary activities of their respective fields of study.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(16, 477, 0, 0, 0, '', 'Kursus ini merupakan kursus asas kepada seni lakonan pentas yang memfokus kepada persiapan tubuh dan diri seorang pelakon untuk sebuah persembahan teater. Pelajar akan didedahkan secara teori dan praktikal mengenai asas teori lakon teori Stanislavski. Pendedahan ini bagi membolehkan pelajar memahami dunia lakonan pentas dan mempelajari secara sepintas lalu mengenai teknik lakonan Stanislavski. Setiap pelajar akan didedahkan secara teori mengenai dunia lakon pentas dan berusaha mengaplikasikan teori dipelajari ke pentas bagi melihat tahap penerimaan dan pemahaman. Di akhir kursus pelajar akan membuat sebuah pementasan teater sebagai salah satu bentuk penilaian.', 'This course is a basic course on stage acting art that focuses on the preparation of the body and the self of an actor for a theater performance. Students will be exposed theoretically and practically on Stanislavski\'s theoretical basis of theory. This exposure enables students to understand the world of stage performances and learn a little about Stanislavski\'s acting technique. Each student will be exposed theoretically about the stage drama world and try to apply the theory learned to the stage to see the level of acceptance and understanding. At the end of the student course will create a theater performance as one of the forms of assessment.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar ', 'Online System, Advisory Academic System and Student Evaluation.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu nilai teras untuk melestarikan kesenian dan kebudayaan tradisional agar dihargai oleh mahasiswa universiti. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mendidik mahasiswa supaya lebih bertanggungjawab, dapat bekerjasama serta mewujudkan persefahaman dalam kerja berkumpulan.', 'One of the core values to preserve traditional arts and culture is to be appreciated by university students. It is also a great way to enhance the self-esteem and self-esteem of university students. Educating students to be more responsible, able to work together and create understanding in group work.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(17, 492, 12, 0, 0, '', 'Kursus ini memberi pengetahuan tentang bantuan kecemasan, memberi arahan, membuat keputusan yang tepat, serta penerapan nilai-nilai murni yang tinggi dalam pembentukan rohani, emosi, jasmani dan sahsiah individu.  Pemahaman terhadap kandungan kursus akan menghasilkan insan yang sentiasa ikhlas, bertanggungjawab dan bersedia membantu tanpa mengira kaum, bangsa, agama, jantina, tahap umur dan lokasi. Tahap disiplin diri yang tinggi dapat dipupuk disamping kerja secara individu serta berpasukan. Skop pembelajaran meliputi tiga aspek penting iaitu; Sejarah Perkembangan PBSMM, IFRC dan ICRC, Undang-undang Kemanusiaan Antarabangsa, dan Pertolongan Cemas Asas. Selain itu aspek teori dan praktikal dilaksanakan secara sistematik untuk meningkatkan kefahaman kepada pelajar mengenainya.\r\n\r\n', 'This course provides knowledge on first aid, giving instruction, making the right decision, and the integration of high moral values in developing the spiritual, emotional, physical and good conduct of a person. The understanding of the course contents would produce individuals that are honest, responsible and willing to help regardless of race, race, religion, gender, age and location. Students can develop high levels of self-discipline as well as can work independently and in a team. The scope of learning covers three important aspects: Historical Development of PBSMM, IFRC and ICRC, International Humanitarian Law, and Basic First Aid. In addition, theoretical and practical aspects are systematically implemented to enhance students\' understanding of it.\r\n', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar\r\n', 'Online System, Advisory Academic System and Student Evaluation.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam\r\nmeningkatkan kemahiran insaniah melalui aktiviti silang bidang\r\npengajian.\r\n', 'The course is offered to provide students the opportunity to enhance\r\ntheir soft skills through cross-discipline activities', 'Pemahaman terhadap kandungan kursus akan menghasilkan insan yang sentiasa ikhlas, bertanggungjawab dan bersedia membantu tanpa mengira kaum, bangsa, agama, jantina, tahap umur dan lokasi. Pelajar dapat membentuk tahap disiplin diri yang tinggi serta boleh bekerja secara individu serta berpasukan.\r\n\r\n', 'Understanding the course content will enable students to be sincere, responsible and willing to help irrespective of race, race, religion, gender, age and location. Students can form high levels of self-discipline and can work independently and in a team.\r\n', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(18, 488, 0, 0, 0, '', 'Kursus ini berkenaan seni persembahan Rebana Kercing. Kursus ini memberi pendedahan dan penekanan kepada mahasiswa tentang jenis-jenis tarian, dan lagu/muzik yang digunakan di dalam persembahan Rebana Kercing. Pelajar akan diperkenalkan dengan alat muzik utama, lagu dan tarian. Mahasiswa akan mempelajari satu jenis lagu dan tarian. Selain itu, pelajar juga akan berpeluang untuk mengenalpasti jenis-jenis busana dalam persembahan Rebana Kercing yang perlu disesuaikan dengan solekan tertentu. Asas pengurusan kumpulan juga akan dipraktikan kepada pelajar melalui persembahan Rebana Kercing.', 'This course is about Rebana Kercing performing arts. This course gives exposure and emphasis to students about the types of dance, and songs/musics used in Rebana Kercing performances. Students will be introduced with main musical instruments, songs and dances. Students will learn one type of music and dance. Also, students will have the chance to identify types of costume in Rebana Kercning performance that need to be suits with certain make up. The basic management concept will be implemented to students through Rebana Kercing performance ', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar \r\n.\r\n', 'Online System, Advisory Academic System and Student Evaluation', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu nilai teras untuk melestarikan kesenian dan kebudayaan tradisional agar dihargai oleh mahasiswa universiti.. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mendidik mahasiswa supaya lebih bertanggungjawab, dapat bekerjasama serta mewujudkan persefahaman dalam kerja berkumpulan.', 'One of the core values to preserve traditional arts and culture is to be appreciated by university students. It is also a great way to enhance the self-esteem and self-esteem of university students. Educating students to be more responsible, able to work together and create understanding in group work.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(19, 495, 34, 0, 0, '', 'Kursus ini memberi pengetahuan tentang bantuan kecemasan, memberi arahan, membuat keputusan yang tepat, serta penerapan nilai-nilai murni yang tinggi dalam pembentukan rohani, emosi, jasmani dan sahsiah individu.  Pemahaman terhadap kandungan kursus akan menghasilkan insan yang sentiasa ikhlas, bertanggungjawab dan bersedia membantu tanpa mengira kaum, bangsa, agama, jantina, tahap umur dan lokasi. Tahap disiplin diri yang tinggi dapat dipupuk disamping kerja secara individu serta berpasukan. Skop pembelajaran meliputi tiga aspek penting iaitu; Sejarah Perkembangan PBSMM, IFRC dan ICRC, Undang-undang Kemanusiaan Antarabangsa, dan Pertolongan Cemas Asas. Selain itu aspek teori dan praktikal dilaksanakan secara sistematik untuk meningkatkan kefahaman kepada pelajar mengenainya.\r\n\r\n', 'This course provides knowledge on first aid, giving instruction, making the right decision, and the integration of high moral values in developing the spiritual, emotional, physical and good conduct of a person. The understanding of the course contents would produce individuals that are honest, responsible and willing to help regardless of race, race, religion, gender, age and location. Students can develop high levels of self-discipline as well as can work independently and in a team. The scope of learning covers three important aspects: Historical Development of PBSMM, IFRC and ICRC, International Humanitarian Law, and Basic First Aid. In addition, theoretical and practical aspects are systematically implemented to enhance students\' understanding of it.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar \r\n', 'Online System, Advisory Academic System and Student Evaluation.\r\n', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.\r\n', 'Pemahaman terhadap kandungan kursus akan menghasilkan insan yang sentiasa ikhlas, bertanggungjawab dan bersedia membantu tanpa mengira kaum, bangsa, agama, jantina, tahap umur dan lokasi. Pelajar dapat membentuk tahap disiplin diri yang tinggi serta boleh bekerja secara individu serta berpasukan.\r\n\r\n\r\n', 'Understanding the course content will enable students to be sincere, responsible and willing to help irrespective of race, race, religion, gender, age and location. Students can form high levels of self-discipline and can work independently and in a team.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(20, 496, 0, 0, 0, '', 'Kursus Kokurikulum badan beruniform Kumpulan Latihan Kelana Siswa Udara memberikan penekanan kepada pelajar mengenai kebolehan memberi arahan dan sentiasa berada dalam tahap disiplin yang tinggi. Ianya juga membentuk pelajar agar boleh memberikan perkhidmatan kemasyarakatan pada bila-bila masa. ', 'The uniformed Co-curriculum course of the Malaysian University Air Rover Training Group emphasizes to the students on the ability to giving orders and always be in the high disciplinary state. It will also shape the students into giving community service at any time. \r\n\r\n', '', '', 'Sistem atas talian, sistem penasihatan akademik. ', 'Oline system, advisory academic system. ', 'Kursus ini dapat menghubungkaitkan teori dan kemahiran asas pengakap. Selain itu, ia dapat mendemonstrasikan kemahiran khusus pengakap secara amali dan dapat mempamerkan semangat kepimpinan dan kerja berpasukan melalui pengelolaan projek. ', 'This course can relate the theory and basic skills of scouts. Additionally, it demonstrates the special skills of a scout in practical and can demonstrate the spirit of leadership and teamwork through project management. ', 'Kursus ini dapat mengembangkan kebolehan mental, minat, bakat serta perkembangan rohani dan jasmani pelajar melalui hubungkaitkan teori dan kemahiran asas pengakap. ', 'This course will develop the mental, interest, talent and spiritual and physical development of the students by relating the theory and basic skills of scouts. ', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(21, 475, 0, 0, 0, '', 'Kursus ini mendedahkan pelajar kepada tentang sejarah asal usul, peranan dan fungsi muzik dalam masyarakat serta gaya muzik permainan seni muzik gamelan. Selain itu, ia  turut memberi pendedahan dari aspek konsep muzik serta  fungsi alat-alat muzik serta ciri-ciri muzik gamelan seperti inang dan berturus gambang. Pelajar-pelajar juga diperkenalkan dengan  not-not muzik gamelan. Penekanan akan diberikan kepada aspek pratikal yang melibatkan latihan dan penggunaan peralatan muzik gamelan. Pelajar juga di dedahkan mengenai etika pemuzik dan pengurusan sesuatu persembahan seni muzik gamelan.', 'This course exposes the students to the history of the origin, roles and functions of gamelan musical art. In addition, it also will give exposure on the  musical concept and the musical instruments function and the gamelan musical characteristics such as inang and berturus gambang. The students will also be introduced to gamelan musical notes. Emphasize will be given on the practical aspects that involved training and the usage of gamelan musical instruments. Students will also be exposed on the musician ethics and the management on the performance of gamelan musical art. ', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar ', 'Online System, Advisory Academic System and Student Evaluation', 'Matlamat kursus ini adalah untuk melahirkan pelajar yang dapat menghargai nilai-nilai estitika budaya bangsa dan dapat menghayati eksperasi seni muzik gamelan.\r\n\r\n', 'The objective of this course is to produce students that appreciate the aesthetical nation cultural values and to appreciate the expression of gamelan musical art.', 'Salah satu nilai teras untuk melestarikan kesenian dan kebudayaan tradisional agar dihargai oleh mahasiswa universiti. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mendidik mahasiswa supaya lebih bertanggungjawab, dapat bekerjasama serta mewujudkan persefahaman dalam kerja berkumpulan.', 'In order to be appreciated by university students, this is one core way to preserve traditional arts and culture. It is also a great way to enhance the self-esteem and self-value of university students. Educating students to be more responsible, be able to work together and create understanding in group work.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(22, 483, 0, 0, 0, '', 'Kursus ini mampu meningkatkan kesedaran pelajar ke atas tanggungjawab memelihara keamanan dan kedaulatan negara. Ia juga dapat membentuk disiplin yang tinggi dalam kalangan pelajar dan dapat membantu mereka untuk cemerlang dalam pengajian di universiti dan seterusnya menjadi warganegara yang bertanggungjawa. Selain itu dapat menambah pengetahuan dan kemahiran dalam pengendalian senjata api sebagai satu keperluan kepada anggota pasukan wataniah. mendapat pengetahuan tentang ilmu medan perang dan taktik peperangan. Ia juga dapat melahirkan bakat-bakat kepimpinan yang mampu memimpin pasukan mencapai matlamat dengan berkesan.Ini mampu membantu pelajar menonjolkan diri sama ada semasa di universiti ataupun setelah berkerjaya.', 'The course was able to increase students \' awareness on the responsibility of preserving peace and sovereignty of the country. It is also to create high discipline among students and helps them to Excel in University and subsequently became a citizen respond . In addition can add knowledge and skills in handling firearms as a requirement to the team member wataniah. gain knowledge of the battlefield knowledge and tactics of war. It also can produce talents of leadership that is able to lead the team achieve the goal effectively. Is able to help students make out either at the University or having a career.', '', '', 'Kaedah maklumbalas prestasi', 'Methods for feedback on proformence', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu pembelajaran ilmu ketenteraan yang terdapat dalam Askar Wataniah ialah tumpuan terhadap disiplin diri. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mahasiswa juga akan mempelajari sifat-sifat menjadi pemimpin dan diajar untuk tidak menyalahgunakan latihan yang dipelajari.', 'One learning military knowledge of the Cbx is the focus on self discipline. It is also a good way to increase the self-confidence and self-esteem of University students. Students will also learn the properties emerged as leader, and taught not to misuse the training learned.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(23, 489, 0, 0, 0, '', 'Kursus ini berkenaan persembahan Wayang Kulit Kelantan. Pelajar akan didedahkan dengan sejarah asal usul, peranan, fungsi muzik dan asas perdalangan dalam persembahan Wayang Kulit Kelantan. Selain itu, kursus ini juga turut memberi pendedahan dari segi konsep muzik serta fungsi alat-alat muzik Wayang Kulit Kelantan. Penekanan akan diberi kepada ciri-ciri muzik Wayang Kulit Kelantan melalui latihan praktikal. Etika pemuzik Wayang Kulit Kelantan dan tatacara pengurusan persembahan Wayang Kulit juga akan diterapkan kepada pelajar.', 'This course is about Kelantanese Wayang Kulit performance. The students will be exposed to the history, role, function of music and basic to playing of shadow puppet in Kelantanese Wayang Kulit Performance. Besides, this course also will provide the exposure on musical concept and the fuction of musical instrument involved in Kelantanese Wayang Kulit. The elements of Kelantanese Wayang Kulit will be taught during the practical training. Also, the Kelantanese Wayang Kulit’s ethics and management are part of the course.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar \r\n\r\n', 'Online System, Advisory Academic System and Student Evaluation.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities', 'Salah satu nilai teras untuk melestarikan kesenian dan kebudayaan tradisional agar dihargai oleh mahasiswa universiti.. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mendidik mahasiswa supaya lebih bertanggungjawab, dapat bekerjasama serta mewujudkan persefahaman dalam kerja berkumpulan.', 'One of the core values to preserve traditional arts and culture is to be appreciated by university students. It is also a great way to enhance the self-esteem and self-esteem of university students. Educating students to be more responsible, able to work together and create understanding in group work.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', '');
INSERT INTO `sp_course_profile` (`id`, `crs_version_id`, `prerequisite`, `offer_sem`, `offer_year`, `offer_remark`, `synopsis`, `synopsis_bi`, `transfer_skill`, `transfer_skill_bi`, `feedback`, `feedback_bi`, `objective`, `objective_bi`, `rational`, `rational_bi`, `created_at`, `updated_at`, `staff_academic`, `requirement`, `additional`, `requirement_bi`, `additional_bi`, `offer_at`) VALUES
(24, 498, 0, 0, 0, '', 'Kursus ini memperkenalkan tentang sejarah penubuhan, peranan dan tanggungjawab pasukan Polis di Malaysia. Disamping itu pelajar juga diperkenalkan tentang penampilan imej dan rupa diri sebagai seorang anggota polis yang berwibawa. Sistem pemakaian pangkat, gelaran, jenis-jenis pakaian, bidang kuasa polis, latihan kawad dan keselamatan juga akan dipelajari melalui pendekatan teori dan amali.', 'This course introduces the history of the establishment, the roles and responsibilities of the Police team in Malaysia. In addition, students are also introduced about the appearance of the image and appearance as a credible policeman. The use of ranks, titles, clothing types, police jurisdiction, wire training and safety systems will also be learned through theoretical and practical approaches.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik.\r\n\r\n', 'Online System, Advisory Academic System.', 'Matlamat kursus ini adalah untuk melahirkan pelajar yang memiliki pengetahuan dan berkeupayaan dalam polis serta kemahiran  insaniah bagi menyesuaikan diri dalam persekitaran kerjaya.', 'The aim of the course is to produce students who have the knowledge and ability in the police as well as the soft skills to adapt to the career environment.', 'Kursus ini bertujuan untuk menyediakan pelajar dengan landasan akademik dalam pasukan polis dan membolehkan mereka memahami konsep asas pasukan polis. Penekanan diberikan kepada pembangunan kemahiran teknikal yang kuat digabungkan dengan keupayaan pengurusan.', 'The course aims to provide students with an academic foundation in the police force and enable them to understand the basic concepts of the police force. Emphasis is given on the development of strong technical skills combined with management capabilities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(25, 485, 0, 0, 0, '', 'Kursus ini akan memperkenalkan dan mendedahkan pelajar berkenaan dengan seni mempertahankan diri Silat Seni Gayong (Pasukan Khas Briged Gayong) daripada segi teori, teknikal dan praktikal. Pelajar akan mempelajari perundangan, peraturan-peraturan dan adat istiadat Silat Seni Gayong dibawah kelolaan Pusat pengajian ISG (Institut Silat Seni Gayong). Pelajar juga akan diberi penekanan terhadap disiplin diri. Di samping itu juga pelajar akan mempelajari sejarah, falsafah, etika, jati diri, kawad disiplin badan beruniform, kenegaraan, kepimpinan, undang-undang dan akta seni mempertahankan diri serta modul asas tempur tanpa senjata super combat (TTS) Silat Seni Gayong Malaysia secara praktikal melalui pengajian kokurikulum Kadet Briged Gayong Berkredit.\r\n', 'This course emphasizes students with respect to martial arts of Silat Seni Gayong in theory, technical and practical. Students will learn the rules and customs of the Silat Gayong art of Malaysia. Students will also be emphasized on self-discipline. In addition, students will learn the basic movements of martial arts, movements, and the capture of the Silat Seni Gayong in Malaysia practically.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik Tertakluk kepada Peraturan Akademik UMK', 'Online System, Advisory Academic System, subject to UMK\'s Academic Rules and Regulations.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students with the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu nilai teras yang terdapat dalam seni mempertahankan diri ialah tumpuan terhadap disiplin diri. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mahasiswa juga akan mempelajari sifat-sifat rendah hati dan diajar untuk tidak menyalahgunakan latihan yang dipelajari. ', 'One of the core values found in martial arts is the focus on self-discipline. It is also a good way to improve the self-esteem and self-esteem of university students. Students will also learn humble traits and be taught not to abuse the learned exercises.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(26, 487, 0, 0, 0, '', 'Kursus ini berkenaan persembahan dikir barat; memberi pendedahan kepada pelajar tentang pengenalan, sejarah, nyanyian, alat muzik dan gerak tari awak-awak serta gaya muzik dikir barat di Negeri Kelantan. Kursus ini juga menumpukan aspek asas seperti vokal bagi tok jogho, tukang karut dan awak-awak, konsep muzik dikir barat, gerak tari dan tepukan awak-awak. Pelajar juga akan diberi penekanan dalam aspek praktikal yang melibatkan latihan dan penggunaan alat muzik, nyanyian, gerak tari dan tepukan awak-awak dalam dikir barat. Selain itu, kursus ini juga akan memberi pendedahan kepada pelajar mengenai etika dan pengurusan sesuatu persembahan dikir barat.', 'This course is about dikir barat performance. The students will expose to the introduction, history, singing style, musical instrument and dancing styles of dancer (awak-awak) and the Kelantanese dikir barat. This course also focus on the aspect on vocal for the lead singer (tok jogho), team members (tukang karut dan awak-awak), the concept of dikir barat, dancing styles (including tepukan awak-awak) in dikir barat performance. Also, this couse will provide an exposure to the students on ethics and dikir barat management.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar \r\n', 'Online System, Advisory Academic System and Student Evaluation.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian. ', 'This course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities. ', 'Salah satu nilai teras untuk melestarikan kesenian dan kebudayaan tradisional agar dihargai oleh mahasiswa universiti. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mendidik mahasiswa supaya lebih bertanggungjawab, dapat bekerjasama serta mewujudkan persefahaman dalam kerja berkumpulan.', 'One of the core values to preserve traditional arts and culture is to be appreciated by university students. It is also a great way to enhance the self-esteem and self-esteem of university students. Educating students to be more responsible, able to work together and create understanding in group work.\r\n', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(27, 494, 0, 0, 0, '', 'Kursus ini akan memperkenal dan mendedahkan pelajar berkenaan dengan ilmu Pertahanan Awam dari aspek teori, teknikal dan praktikal. Pelajar akan mempelajari asas pertahanan awam, pengurusan, peraturan-peraturan dan kemahiran-kemahiran asas pertahanan awam dibawah kelolaan Jurulatih yang dilatih oleh Angkatan Pertahanan Awam Malaysia (APM). Pelajar juga akan diberi penekanan terhadap disiplin diri. Di samping itu juga pelajar akan mempelajari sejarah, falsafah, etika, jati diri, kawad, disiplin badan beruniform, kenegaraan, kepimpinan, undang-undang dan akta Pertahanan Awam.', 'This course will introduce and expose students with respect to Public Defense knowledge from theoretical, technical and practical aspects. Students will learn basic civil defense, management, rules and basic defense skills under the Manager\'s coaches trained by the Malaysian Civil Defense Force (APM). Students will also be emphasized on self-discipline. In addition, students will learn history, philosophy, ethics, identity, wire, uniform discipline, statehood, leadership, law and the Civil Defense Act.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik\r\n\r\n', 'Online System, Advisory Academic System.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu nilai teras yang terdapat dalam ilmu Pertahanan Awam ialah disiplin diri. Ia juga salah satu cara yang baik untuk meningkatkan keyakinan diri dan kepakaran mahasiswa semasa pengajian di Universiti dan membantu pembentukan sahsah diri sebagai persediaan untuk menghadapi cabaran yang lebih global selepas tamat pengajian.', 'One of the core values found in Public Defense is self discipline. It is also one of the good ways to improve student self-esteem and expertise during studies at the University and help to establish self-help in preparation for a more global challenge after graduation.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(28, 493, 0, 0, 0, '', 'Kursus ini berkenaan seni persembahan Mak Yong. Kursus ini memberi pendedahan dan penekanan kepada mahasiswa tentang jenis-jenis tarian, lakonan dan lagu/muzik yang digunakan di dalam persembahan Mak Yong. Pelajar akan diperkenalkan dengan alat muzik utama, lagu, tarian dan lakonan. Mahasiswa akan mempelajari lakonan dan tiga jenis tarian: satu jenis tarian utama dan dua jenis tarian sampingan di dalam persembahan Mak Yong. Selain itu, pelajar juga akan berpeluang untuk mengenalpasti jenis-jenis busana dalam persembahan Mak Yong yang perlu disesuaikan dengan solekan tertentu. Asas pengurusan kumpulan juga akan dipraktikan kepada pelajar melalui persembahan Mak Yong.', 'This course is about Mak Yong performing arts. This course gives exposure and emphasis to students about the types of dance, acting and songs/musics used in Mak Yong performances. Students will be introduced with main musical instruments, songs, dances and acting. Students will learn acting and three types of dances: one main types of dances and two side of the dancing in Mak Yong. Also, students will have the chance to identify types of costume in Mak Yong performance that need to be suits with certain make up. The basic management concept will be implemented to students through Mak Yong performance. ', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar ', 'Online System, Advisory Academic System and Student Evaluation.\r\n\r\n', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu nilai teras untuk melestarikan kesenian dan kebudayaan tradisional agar dihargai oleh mahasiswa universiti. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mendidik mahasiswa supaya lebih bertanggungjawab, dapat bekerjasama serta mewujudkan persefahaman dalam kerja berkumpulan.', 'One of the core values to preserve traditional arts and culture is to be appreciated by university students. It is also a great way to enhance the self-esteem and self-esteem of university students. Educating students to be more responsible, able to work together and create understanding in group work.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(31, 464, 0, 0, 0, '', 'Kursus ini memberi peluang kepada para pelajar dalam mengenali sejarah, peralatan dan pakaian bola baling, peraturan dan undang-undang yang sepatutnya di dalam sesuatu perlawanan mahupun permainan. Aspek-aspek kecergasan, regangan dan kemahiran yang meliputi teknik, tektik, teori serta amali juga turut diajar di dalam subjek ini. Pelajar juga didedahkan dengan semangat berpasukan semasa mengendalikan pertandingan.', 'This course gives students the opportunity to know the history, equipment and handball garments, rules and regulations that should be in a game or game. Fitness, stretching and skills aspects covering techniques, tactics, theories and practices are also taught in this subject. Students are also exposed to team spirit while conducting competitions.', '', '', 'Penilaian berterusan:               100%\r\n\r\n a.   Refleksi	 	                   50%                \r\n     \r\nb.    Pengurusan Aktiviti             50 %\r\n \r\n       JUMLAH                            100%\r\n\r\nPeperiksaan Akhir:                  TIADA\r\nPentaksiran Akhir :                  TIADA\r\n\r\n\r\nTertakluk kepada Peraturan Akademik UMK.', 'Continuous assessment:               100%\r\n\r\na.   Reflexy	 	                        50%                \r\n     \r\nb.   Activity Management                50 %\r\n \r\n      TOTAL                            	       100%\r\n\r\nFinal Examination:                        TIADA\r\nFinal Assessment:                         TIADA\r\n\r\n\r\nSubject to UMK’s Academic Rules and Regulations.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.', 'Exposure to students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms among other universities either domestically or abroad through co-curricular activities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(32, 470, 0, 0, 0, '', 'Kursus ini menerangkan mengenai sejarah permainan golf, peralatan, peraturan dan kaedah permainan, istilah-istilah dan  sistem permainan golf.  Latihan praktikal diberikan untuk menilai tahap kecergasan dan kemahiran pelajar.  Sebagai contoh latihan teknik pukulan asas.', 'This course explains the history of golf, the equipment needed, rules and methods on how to play, terms and system of golf. Practical training will be given to assess the fitness and skills of students. For example, training on basic stroke techniques.\r\n', '', '', 'Penilaian berterusan:               100%\r\n\r\na.   Refleksi	 	                   50%                \r\n     \r\nb.   Pengurusan Aktiviti             50 %\r\n \r\n      JUMLAH                             100%\r\n\r\nPeperiksaan Akhir:                  TIADA\r\nPentaksiran Akhir :                  TIADA\r\n\r\nTertakluk kepada Peraturan Akademik UMK.', 'Continuous assessment:              100%\r\n\r\na.   Reflexy	 	                        50%                \r\n     \r\nb.   Activity management                50 %\r\n \r\n      TOTAL                            	      100%\r\n\r\nFinal Examination:                       TIADA\r\nFinal Assessment:                       TIADA\r\n\r\nSubject to UMK’s Academic Rules and Regulations.', 'Matlamat kursus ini adalah untuk melahirkan pelajar yang memiliki pengetahuan dan berkeupayaan untuk bermain golf serta kemahiran  insaniah bagi menyesuaikan diri dalam persekitaran kerjaya.', 'The goal of this course is to produce students who have the knowledge and capability to play golf as well as the soft skills of career adaptability\r\n', 'Kursus ini bertujuan untuk menyediakan pelajar dengan landasan akademik dalam golf dan membolehkan mereka memahami konsep asas permainan golf. Penekanan diberikan kepada pembangunan kemahiran teknikal yang kuat digabungkan dengan keupayaan pengurusan\r\n\r\n', 'The course aims to provide students with an academic track in golf and allowing them to understand the basic concepts of golf games. Emphasis is given on the development of strong technical skills combined with management capabilities \r\n', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(33, 471, 0, 0, 0, '', 'Kursus ini meliputi sejarah permainan tenis, pengenalan peralatan, gelanggang dan undang-undang permainan, mengetahui latihan dan teknik permainan serta semangat berpasukan dalam pengelolaan pertandingan / projek.', 'This course covers the history of tennis games, equipment identification, court and game law, knowing the training and game techniques as well as the spirit of teamwork in the management of the contest / project.', '', '', 'Penilaian berterusan:                    100%\r\n\r\na.   Refleksi	 	                       50%                \r\n     \r\nb.   Pengurusan Aktiviti                 50 %\r\n \r\n      JUMLAH                                  100%\r\n\r\nPeperiksaan Akhir:                       TIADA\r\nPentaksiran Akhir :                       TIADA\r\n\r\nTertakluk kepada Peraturan Akademik UMK.', 'Continuous assessment:                100%\r\n\r\na.   Reflexy	 	                         50%                \r\n     \r\nb.   Activity management                 50 %\r\n \r\n      TOTAL                            	        100%\r\n\r\nFinal Examination:                          TIADA\r\nFinal Assessment:                          TIADA\r\n\r\nSubject to UMK’s Academic Rules and Regulations.', 'Matlamat kursus ini adalah untuk melahirkan pelajar yang memiliki pengetahuan dan berkeupayaan untuk bermain tenis serta kemahiran  insaniah bagi menyesuaikan diri dalam persekitaran kerjaya.\r\n', 'The goal of this course is to produce students who have the knowledge and capability to play tennis as well as the soft skills of career adaptability\r\n', 'Kursus ini bertujuan untuk menyediakan pelajar dengan landasan akademik dalam tenis dan membolehkan mereka memahami konsep asas permainan tenis. Penekanan diberikan kepada pembangunan kemahiran teknikal yang kuat digabungkan dengan keupayaan pengurusan\r\n\r\n', 'The course aims to provide students with an academic track in tennis and allowing them to understand the basic concepts of tennis games. Emphasis is given on the development of strong technical skills combined with management capabilities \r\n', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
