(36, 497, 0, 0, 0, '', 'Kursus ini bertujuan untuk memberi pendedahan kepada pelajar mengenai peranan sukarelawan koreksional, asas kepenjaraan meliputi pengurusan penjara yang melibatkan keselamatan, penahanan, layanan dan program  pemulihan pemasyarakatan di Jabatan Penjara Malaysia. Selain itu, kurus ini juga memberi pendedahan kepada akta dan peraturan penjara, pembinaan sahsiah. Latihan kemahiran kawad asas, pengenalan dan pengedalian berkenaan teori dan praktikal senjata api, program parol beserta seni bela diri (SENTAP) juga didedahkan kepada pelajar. Di samping itu, pelajar juga diberikan pendedahan tentang pusat kehadiran wajib (PKW) yang melibatkan program dengan komuniti dan perkhidmatan komuniti di institusi penjara.', 'This course aims to provide students with an overview of the role of the correction of volunteers, the basis of prison terms involving prison management involving security, detention, rehabilitation services and rehabilitation programs at the Prisons Department of Malaysia. In addition, this thinner also gives exposure to prison deeds and rules, character building. Basic skill training, introductory and standardization of firearms theory and practice, parole programs and martial arts (SENTAP) are also exposed to students. In addition, students are also exposed to a mandatory presence centre (PKW) involving programs with communities and community services at prison institutions.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik\r\n', 'Online System, Advisory Academic System.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Kursus ini bertujuan untuk menyediakan pelajar dengan landasan akademik dalam pengurusan penjara dan membolehkan mereka memahami konsep asas pengurusan penjara.  Penekanan diberikan kepada pembangunan kemahiran teknikal yang kuat digabungkan dengan keupayaan pengurusan penjara yang meliputi teori dan praktikal dalam kursus.', 'The course aims to provide students with an academic foundation in prison management and enable them to understand the basic concepts of prison management. Emphasis is given to the development of strong technical skills combined with prison management capabilities that include theory and practice in the course.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(37, 499, 37, 0, 0, '', 'Kursus ini mampu meningkatkan kesedaran pelajar ke atas tanggungjawab memelihara keamanan dan kedaulatan negara. Ia juga dapat membentuk disiplin yang tinggi dalam kalangan pelajar dan dapat membantu mereka untuk cemerlang dalam pengajian di universiti dan seterusnya menjadi warganegara yang bertanggungjawab. Selain itu dapat menambah pengetahuan dan kemahiran dalam pengendalian senjata api sebagai satu keperluan kepada anggota pasukan simpanan pegawai latihan mendapat pengetahuan tentang ilmu medan perang dan taktik peperangan. Ia juga dapat melahirkan bakat-bakat kepimpinan yang mampu memimpin pasukan mencapai matlamat dengan berkesan.Ini mampu membantu pelajar menonjolkan diri sama ada semasa di universiti ataupun setelah berkerjaya', 'The course was able to increase students \' awareness on the responsibility of preserving peace and sovereignty of the country. It is also to create high discipline among students and helps them to Excel in University and subsequently became a citizen in charge. In addition can add knowledge and skills in handling firearms as a necessity to members of the reserve officer training. gain knowledge of the battlefield knowledge and tactics of war. It also can produce talents of leadership that is able to lead the team achieve the goal effectively. Is able to help students make out either at the University or having a career.', '', '', 'Menunjukkan nilai-nilai murni yang diterima sejagat dalam semua situasi', 'Display universally acceptable good values in all situations', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft\r\nskills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi,kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin,kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di\r\ndalam atau luar negara melalui aktiviti kokurikulum.\r\n', 'One of the knowledge learning in the military Reserve Officer Training is a focus on self discipline. It is also a good way to increase the self-confidence and selfesteem of University students. Students will also learn the properties emerged as leader, and taught not to misuse the training learned.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(38, 504, 0, 0, 0, '', 'Kursus ini mampu meningkatkan kesedaran pelajar ke atas tanggungjawab memelihara keamanan dan kedaulatan negara. Ia juga dapat membentuk disiplin yang tinggi dalam kalangan pelajar dan dapat membantu mereka untuk cemerlang dalam pengajian di universiti dan seterusnya menjadi warganegara yang bertanggungjawab. Selain itu dapat menambah pengetahuan dan kemahiran dalam pengendalian senjata api sebagai satu keperluan kepada anggota pasukan simpanan pegawai latihan . mendapat pengetahuan tentang ilmu medan perang dan taktik peperangan. Ia juga dapat melahirkan bakat-bakat kepimpinan yang mampu memimpin pasukan mencapai matlamat dengan berkesan.Ini mampu membantu pelajar menonjolkan diri sama ada semasa di universiti ataupun setelah berkerjaya.', 'The course was able to increase students \' awareness on the responsibility of preserving peace and sovereignty of the country. It is also to create high discipline among students and helps them to Excel in University and subsequently became a citizen in charge. In addition can add knowledge and skills in handling firearms as a necessity to members of the reserve officer training. gain knowledge of the battlefield knowledge and tactics of war. It also can produce talents of leadership that is able to lead the team achieve the goal effectively. Is able to help students make out either at the University or having a career.', '', '', 'Menunjukkan nilai-nilai murni yang diterima sejagat dalam semua situasi. ', 'Display universally acceptable good values in all situations', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu pembelajaran ilmu ketenteraan yang terdapat dalam Pasukan Simpanan Pegawai Latihan ialah tumpuan terhadap disiplin diri. Ia juga cara yang baik untuk meningkatkan keyakinan diri dan harga diri mahasiswa universiti. Mahasiswa juga akan mempelajari sifat-sifat menjadi pemimpin dan diajar untuk tidak menyalahgunakan latihan yang dipelajari.', 'One of the knowledge learning in the military Reserve Officer Training is a focus on self discipline. It is also a good way to increase the self-confidence and self-esteem of University students. Students will also learn the properties emerged as leader, and taught not to misuse the training learned.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(39, 500, 0, 0, 0, '', 'Kursus ini memperkenalkan tentang sejarah penubuhan, peranan dan tanggungjawab pasukan Polis di Malaysia. Disamping itu pelajar juga diperkenalkan tentang penampilan imej dan rupa diri sebagai seorang anggota polis yang berwibawa. Sistem pemakaian pangkat, gelaran, jenis-jenis pakaian, bidang kuasa polis, latihan kawad dan keselamatan juga akan dipelajari melalui pendekatan teori dan amali.', 'This course introduces the history of the establishment, the roles and responsibilities of the Police team in Malaysia. In addition, students are also introduced about the appearance of the image and appearance as a credible policeman. The use of ranks, titles, clothing types, police jurisdiction, wire training and safety systems will also be learned through theoretical and practical approaches.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik.\r\n', 'Online System, Advisory Academic System.\r\n', 'Matlamat kursus ini adalah untuk melahirkan pelajar yang memiliki pengetahuan dan berkeupayaan dalam polis serta kemahiran  insaniah bagi menyesuaikan diri dalam persekitaran kerjaya.', 'The aim of the course is to produce students who have the knowledge and ability in the police as well as the soft skills to adapt to the career environment.\r\n', 'Kursus ini bertujuan untuk menyediakan pelajar dengan landasan akademik dalam pasukan polis dan membolehkan mereka memahami konsep asas pasukan polis. Penekanan diberikan kepada pembangunan kemahiran teknikal yang kuat digabungkan dengan keupayaan pengurusan.\r\n', 'The course aims to provide students with an academic foundation in the police force and enable them to understand the basic concepts of the police force. Emphasis is given on the development of strong technical skills combined with management capabilities.\r\n', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(40, 502, 0, 0, 0, '', 'Kursus ini merupakan lanjutan daripada kursus Kor Sispa I dimana pelajar akan didedahkan secara lebih mendalam berkenaan dengan ilmu Pertahanan Awam dari aspek teori, teknikal dan praktikal. Pelajar akan mempelajari beberapa kemahiran yang lebih mencabar  dalam pertahanan awam  selain daripada kemahiran asas pertahanan awam yang telah dipelajari  sebelum ini dibawah kelolaan Jurulatih yang dilatih oleh Angkatan Pertahanan Awam Malaysia (APM). Pelajar juga akan diberi penekanan  secara lebih spesifik dan menyeluruh dari aspek pengurusan, kepakaran kemahiran, perundangan dan akta pertahanan awam bagi melayakkan pelajar ditauliahkan. \r\n\r\n', 'This course is an extension of the Sispa I Corps course where students will be exposed more deeply with respect to Public Defense knowledge from theoretical, technical and practical aspects. Students will learn some of the more challenging skills in civil defense other than the basic civil defense skills previously learned under the Trainer trained by the Malaysian Civil Defense Force (APM). Students will also be given more specific and comprehensive emphasis on management, expertise, legal and civil defense skills to qualify students to be accredited.\r\n', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar \r\n', 'Online System, Advisory Academic System and Student Evaluation.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu nilai teras yang terdapat dalam ilmu Pertahanan Awam ialah disiplin diri. Ia juga salah satu cara yang baik untuk meningkatkan keyakinan diri dan kepakaran mahasiswa semasa pengajian di Universiti dan membantu pembentukan sahsah diri sebagai persediaan untuk menghadapi cabaran yang lebih global selepas tamat pengajian.\r\n\r\n', 'One of the core values found in Public Defense is self discipline. It is also one of the good ways to improve student self-esteem and expertise during studies at the University and help to establish self-help in preparation for a more global challenge after graduation.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(41, 501, 0, 0, 0, '', 'Kursus ini memperkenalkan tentang sejarah penubuhan, peranan dan tanggungjawab pasukan Polis di Malaysia. Disamping itu pelajar juga diperkenalkan tentang penampilan imej dan rupa diri sebagai seorang anggota polis yang berwibawa. Sistem pemakaian pangkat, gelaran, jenis-jenis pakaian, bidang kuasa polis, latihan kawad dan keselamatan juga akan dipelajari melalui pendekatan teori dan amali.\r\n', 'This course introduces the history of the establishment, the roles and responsibilities of the Police team in Malaysia. In addition, students are also introduced about the appearance of the image and appearance as a credible policeman. The use of ranks, titles, clothing types, police jurisdiction, wire training and safety systems will also be learned through theoretical and practical approaches.\r\n', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik.\r\n', 'Online System, Advisory Academic System.\r\n', 'Matlamat kursus ini adalah untuk melahirkan pelajar yang memiliki pengetahuan dan berkeupayaan dalam polis serta kemahiran  insaniah bagi menyesuaikan diri dalam persekitaran kerjaya.\r\n', 'The aim of the course is to produce students who have the knowledge and ability in the police as well as the soft skills to adapt to the career environment.\r\n', 'Kursus ini bertujuan untuk menyediakan pelajar dengan landasan akademik dalam pasukan polis dan membolehkan mereka memahami konsep asas pasukan polis. Penekanan diberikan kepada pembangunan kemahiran teknikal yang kuat digabungkan dengan keupayaan pengurusan.', 'The course aims to provide students with an academic foundation in the police force and enable them to understand the basic concepts of the police force. Emphasis is given on the development of strong technical skills combined with management capabilities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
