(43, 503, 0, 0, 0, '', 'Kursus ini merupakan lanjutan daripada kursus Kor Sispa II dimana pelajar akan didedahkan secara lebih mendalam berkenaan dengan ilmu Pertahanan Awam dari aspek teori, teknikal dan praktikal. Pelajar akan mempelajari beberapa tambahan kemahiran yang lebih mencabar dalam pertahanan awam  selain daripada kemahiran asas pertahanan awam yang telah dipelajari  sebelum ini dibawah kelolaan Jurulatih yang dilatih oleh Angkatan Pertahanan Awam Malaysia (APM). Pelajar juga akan diberi penekanan  secara lebih spesifik dan menyeluruh dari aspek pengurusan, kepakaran kemahiran, perundangan dan akta pertahanan awam bagi melayakkan pelajar ditauliahkan. \r\n\r\n', 'This course is an extension of the course of Sisp II where the students will be exposed more deeply in respect of the Civil Defense knowledge from theoretical, technical and practical aspects. Students will learn some of the more challenging skills in civil defense other than the basic civil defense skills previously learned under the coach\'s trainings trained by the Malaysian Civil Defense Force (APM). Students will also be given a more specific and comprehensive emphasis on aspects of management, expertise, law and defense legislation to qualify students to be accredited.\r\n', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik dan Penilaian Pelajar \r\n\r\n', 'Online System, Advisory Academic System and Student Evaluation.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.\r\n\r\n', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Salah satu nilai teras yang terdapat dalam ilmu Pertahanan Awam ialah disiplin diri. Ia juga salah satu cara yang baik untuk meningkatkan keyakinan diri dan kepakaran mahasiswa semasa pengajian di Universiti dan membantu pembentukan sahsah diri sebagai persediaan untuk menghadapi cabaran yang lebih global selepas tamat pengajian.\r\n\r\n', 'One of the core values found in Public Defense is self discipline. It is also one of the good ways to improve student self-esteem and expertise during studies at the University and help to establish self-help in preparation for a more global challenge after graduation.\r\n', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
(44, 508, 0, 0, 0, '', 'Kursus ini akan memperkenalkan dan memberi pendedahan kepada pelajar tentang pengenalan Ikatan Relawan Rakyat (RELA), perundangan RELA, penyatuan bangsa, konsep sukarela, latihan kawad kaki, komunikasi berkesan, operasi dan perundangan, kenegaraan dan nilai etika, pengelolaan khidmat bakti siswa, teknik bersenjata, operasi menyelamat, latihan medan perang, pengurusan rusuhan dan gempur, seni silat RELA, dan operasi pencegahan.', 'This course will introduce and expose students to the introduction of the Malaysian People\'s Volunteer Corps (RELA), RELA legislation, national unity, voluntary concepts, march training, effective communication, operations and legislation, statehood and ethical values, management of student service, armed technic , rescue operations, battleground exercises, riot and combat management, RELA martial arts, and preventive operation.', '', '', 'Sistem Atas Talian, Sistem Penasihatan Akademik Tertakluk kepada Peraturan Akademik UMK', 'Online System, Advisory Academic System, subject to UMK\'s Academic Rules and Regulations.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di\r\ndalam atau luar negara melalui aktiviti kokurikulum.\r\n', 'Exposure to the students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms among other universities either in within or outside the country through co-curriculum activities.', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
