(47, 511, 0, 0, 0, '', 'Kursus Kokurikulum ini bertujuan mendedahkan pelajar-pelajar kepada ilmu sukan penerbitan video dari segi kemahiran teori dan teknikal. Dari segi teori, kursus ini lebih menjurus kepada sejarah, latar belakang, termilonology, pengurusan diri dan lain-lain yang berkaitan dengan penerbitan video. Manakala dari segi teknikal, kursus ini lebih menumpukan kepada latihan amali (practical) dari segi kemahiran bermain penerbitan video.', 'syn', '', '', 'online', 'online', 'ob', 'ob', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.', 'en', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', '', ''),
