(61, 1000, 0, 1, 1, '', 'Kursus ini memberi peluang kepada para pelajar dalam mengenali sejarah, peralatan dan pakaian bola baling, peraturan dan undang-undang yang sepatutnya di dalam sesuatu perlawanan mahupun permainan. Aspek-aspek kecergasan, regangan dan kemahiran yang meliputi teknik, tektik, teori serta amali juga turut diajar di dalam subjek ini. Pelajar juga didedahkan dengan semangat berpasukan semasa mengendalikan pertandingan.', 'This course gives students the opportunity to know the history, equipment and handball garments, rules and regulations that should be in a game or game. Fitness, stretching and skills aspects covering techniques, tactics, theories and practices are also taught in this subject. Students are also exposed to team spirit while conducting competitions.', '', '', 'Penilaian berterusan:               100%\r\n\r\n a.   Refleksi	 	                   50%                \r\n     \r\nb.    Pengurusan Aktiviti             50 %\r\n \r\n       JUMLAH                            100%\r\n\r\nPeperiksaan Akhir:                  TIADA\r\nPentaksiran Akhir :                  TIADA\r\n\r\n\r\nTertakluk kepada Peraturan Akademik UMK.', 'Continuous assessment:               100%\r\n\r\na.   Reflexy	 	                        50%                \r\n     \r\nb.   Activity Management                50 %\r\n \r\n      TOTAL                            	       100%\r\n\r\nFinal Examination:                        TIADA\r\nFinal Assessment:                         TIADA\r\n\r\n\r\nSubject to UMK’s Academic Rules and Regulations.', 'Kursus ini ditawarkan bagi memberi ruang kepada pelajar dalam meningkatkan kemahiran insaniah melalui aktiviti silang bidang pengajian.', 'The course is offered to provide students the opportunity to enhance their soft skills through cross-discipline activities.', 'Pendedahan kepada para pelajar aspek-aspek kemahiran insaniah seperti kemahiran berkomunikasi, kemahiran kepimpinan, kerjasama berpasukan dan pembelajaran sepanjang hayat serta disiplin kepada para pelajar dan memperbanyakkan platform kerjasama di antara universiti lain samada di dalam atau luar negara melalui aktiviti kokurikulum.', 'Exposure to students aspects of soft skills such as communication skills, leadership skills, teamwork and lifelong learning as well as discipline to students and to extend collaborative platforms among other universities either domestically or abroad through co-curricular activities.', '2020-02-12 12:18:44', '2020-02-12 12:18:44', '', '', '', '', '', ''),
