INSERT INTO `tmpl_approve_project` (`id`, `template_name`, `pengarah`, `ppendaftar`, `yg_benar`, `tema`, `per3`, `per4`, `per5`, `signiture_file`, `is_active`, `adj_x`, `adj_y`, `created_at`, `updated_at`) VALUES
(1, 'Template  - Dr. saufi', 'DR. MOHD NAZRI BIN MUHAYIDDIN', 'SITI NOR HIDAYAH CHE HUSSIN', 'Saya yang menjalankan amanah', '\"RAJA BERDAULAT, RAKYAT SEPAKAT, NEGERI BERKAT\"\r\n\"BERKHIDMAT UNTUK NEGARA\"', 'Sepanjang tempoh program berlangsung, mohon pihak {TUAN} dan fasilitator berkenaan untuk menjaga nama baik Universiti Malaysia Kelantan serta memastikan program tersebut berjalan dengan lancar dan mematuhi peraturan-peraturan universiti.', 'Sehubungan dengan itu, pihak {TUAN} adalah dipohon untuk mengemukakan laporan aktiviti berserta gambar (dalam bentuk CD) serta laporan kewangan (beserta resit-resit asal pembelian) dalam tempoh satu (1) minggu dari tarikh program diadakan kepada Pusat Kokurikulum. Bersama-sama ini disertakan borang laporan aktiviti pelajar dan borang akuan penerimaan wang untuk tindakan pihak {TUAN}.', 'Sekiranya terdapat sebarang pertanyaan, pihak {TUAN} boleh menghubungi Puan Siti Norhidayah bin Mat Hussin di talian (09-7717094/014-6691481). Sebarang perubahan/pindaan akan dimaklumkan dengan kadar segera.', '2020/830720035643/signiture_16003635025f639beebd11e4.76344563.png', 1, 0, 0, '2020-09-18 00:00:00', '2020-11-09 12:46:33'),
(2, 'Copy of Template surat lama - Dr. Nazri', 'DR. MOHD NAZRI BIN MUHAYIDDIN', '', 'Saya yang menjalankan amanah', '\"RAJA BERDAULAT, RAKYAT SEPAKAT, NEGERI BERKAT\"\r\n\"BERKHIDMAT UNTUK NEGARA\"', 'Sepanjang tempoh program berlangsung, mohon pihak {TUAN} dan fasilitator berkenaan untuk menjaga nama baik Universiti Malaysia Kelantan serta memastikan program tersebut berjalan dengan lancar dan mematuhi peraturan-peraturan universiti.', 'Sehubungan dengan itu, pihak {TUAN} adalah dipohon untuk mengemukakan laporan aktiviti berserta gambar (dalam bentuk CD) serta laporan kewangan (beserta resit-resit asal pembelian) dalam tempoh satu (1) minggu dari tarikh program diadakan kepada Pusat Kokurikulum. Bersama-sama ini disertakan borang laporan aktiviti pelajar dan borang akuan penerimaan wang untuk tindakan pihak {TUAN}.', 'Sekiranya terdapat sebarang pertanyaan, pihak {TUAN} boleh menghubungi Puan Siti Norhidayah bin Mat Hussin di talian (09-7717094/014-6691481). Sebarang perubahan/pindaan akan dimaklumkan dengan kadar segera.', '2020/830720035643/signiture_16003635025f639beebd11e4.76344563.png', 0, 0, 0, '2020-11-09 12:42:26', '0000-00-00 00:00:00');
INSERT INTO `tmpl_offer_fasi` (`id`, `template_name`, `pengarah`, `yg_benar`, `tema`, `nota_elaun`, `per3`, `per4`, `signiture_file`, `is_active`, `adj_x`, `adj_y`, `created_at`, `updated_at`) VALUES
(1, 'Template lama - Dr Nazri', 'DR. MOHD NAZRI BIN MUHAYIDDIN', 'Saya yang menjalankan amanah', '\"RAJA BERDAULAT, RAKYAT MUAFAKAT, NEGERI BERKAT\"\r\n\"BERKHIDMAT UNTUK NEGARA\"', 'Tuntutan tidak melebihi 12 Jam untuk satu bulan, maksimum tuntutan 28 jam untuk setiap semester. Tuntutan mestilah dibuat secara bulanan melalui borang yang peroleh di Pusat Kokurikulum berserta salinan surat lantikan dan borang kehadiran pelajar', 'Bersama-sama ini juga disertakan senarai tugas {FASILITATOR} sambilan Kursus Kokurikulum Berkredit Pusat Kokurikulum. (Rujuk Lampiran 1)', 'Sekiranya bersetuju dengan tawaran ini sila penuhi borang penerimaan sebagai {FASILITATOR} sambilan dan kembalikan borang berkenaan sama datang sendiri atau fakskan melalui talian 09-771262 ke Pusat Kokurikulum dengan kadar segera.', '2020/830720035643/signiture_16003101775f62cba1765153.26455937.png', 0, 0, 0, '2020-09-17 09:30:07', '2020-09-17 23:37:28');
